INSERT INTO `nlp_training_designs` VALUES (1,'Kopf des vergöttlichten Alexander des Großen nach rechts mit Diadem und Ammonshorn. Perlkreis.','Diademed head of deified Alexander the Great with horn of Ammon, right. Border of dots.','from CN'),(6,'Flammender und bekränzter Altar.','Altar, lighted and garlanded.','from CN'),(8,'Preisamphora mit verziertem Fuß; im Linienquadrat und quadratum incusum.','Prize amphora on ornamental stand; within linear square and incuse square.','from CN'),(9,'Amphora mit gerippter Bauchoberfläche und gebogenen Henkeln, darin zwei Ähren und Mohnkopf.','Amphora with ribbed surface and crooked handles containing two ears of corn and poppy.','from CN'),(10,'Brustbild des jugendlichen Anchialos nach rechts mit Taenia und Gewand. Perlkreis.','Bust of youthful Anchialos, right, wearing taenia. Border of dots.','from CN'),(11,'Umgekehrter Anker; unter der linken Ankerschaufel, Krebs, unter der rechten, Ethnikon.','Inverted anchor; under left fluke, crayfish, under right fluke, ethnicon.','from CN'),(12,'Umgekehrter Anker; unter der linken Ankerschaufel, Krebs, unter der rechten, Ethnikon; im vertieften Kreis.','Inverted anchor; under left fluke, crayfish, under right fluke, ethnicon; all within circular incuse.','from CN'),(14,'Umgekehrter Anker; unter der rechten Ankerschaufel, Krebs, unter der linken, Ethnikon.','Inverted anchor;  under right fluke, crayfish, under left fluke, ethnicon.','from CN'),(15,'Umgekehrter Anker; unter der rechten Ankerschaufel Krebs, unter der linken, Ethnikon; im quadratum incusum.','Inverted anchor; under right fluke, crayfish, under left fluke, ethnicon; all within shallow incuse square.','from CN'),(17,'Umgekehrter Anker; unter der rechten Ankerschaufel, Krebs.','Inverted anchor; under right fluke, crayfish.','from CN'),(18,'Kopf des Antiochos I. Soter mit Diadem nach rechts.','Diademed head of Antiochus I Soter, right.','from CN'),(19,'Kopf des Antiochos II. Theos mit Diadem nach rechts','Diademed head of Antio