ng, a disc between the horns and an uraeus inside of it.','from CN'),(38,'Nackter Apollon nach rechts schreitend, einen Pfeil haltend und den Bogen in der Linken spannend.','Nude Apollo advancing right, holding arrow and drawing bow in his left hand.','from CN'),(39,'Nackter Apollon mit flatternder Chlamys nach rechts schreitend, einen Pfeil in der Rechten und gespannten Bogen in der Linken haltend.','Nude Apollo advancing right, wearing fluttering chlamys, drawing arrow in right hand from bow in left hand.','from CN'),(42,'Brustbild des Apollon mit Gewand nach rechts; davor Lorbeerzweig.','Draped bust of Apollo, right; in front, laurel-branch.','from CN'),(43,'Kopf des Apollon mit Diadem nach rechts.','Diademed head of Apollo, right.','from CN'),(44,'Kopf des Apollon nach rechts.','Head of Apollo, right.','from CN'),(45,'Brustbild des Apollon nach rechts mit Lorbeerkranz und Gewand.','Laureate and draped bust of Apollo, right.','from CN'),(46,'Brustbild des Apollon nach rechts mit Lorbeerkranz und Gewand; davor Palmzweig.','Laureate and draped bust of Apollo, right; in front, palm branch.','from CN'),(47,'Kopf des Apollon mit Lorbeerkranz von vorn.','Laureate head of Apollo facing.','from CN'),(50,'Kopf des Apollon mit Lorbeerkranz nach rechts.','Laureate head of Apollo, right.','from CN'),(51,'Kopf des Apollon mit Lorbeerkranz nach rechts; im quadratum incusum.','Laureate head of Apollo, right; within incuse square.','from CN'),(52,'Kopf des Apollon mit Lorbeerkranz nach rechts, im Linienquadrat.','Laureate head of Apollo, right; within linear square.','from CN'),(53,'Kopf des Apollon mit Lorbeerkranz nach rechts; Kammmuschel darunter.','Laureate head of Apollo, right; scallop shell below.','from CN'),(58,'Apollon nach links auf Omphalos sitzend, in der Rechten Bogen haltend.','Apollo seated left on omphalos, holding bow in right hand.','from CN'),(59,'Apollon nach links auf Omphalos sitzend, in der Rechten Bogen haltend; darüber Löwenkopf nach rechts; oben rechts Monogramm.','Apollo seated left on omphalos, holding bow in right hand; above lion\'s head right; monogram to outer right.','from CN'),(60,'Apollon nach links thronend, in der vorgestreckten und gesenkten Rechten Lorbeerzweig und in der Linken die hinter ihm stehende Lyra haltend.','Apollo enthroned left, holding laurel-branch in outstreched and lowered right hand and lyra set down behind him in left hand.','from CN'),(61,'Nackter Apollon nach rechts auf einem Fels sitzend und die auf das linke Knie gestellte Leier spielend. Bildleiste.','Nude Apollo seated right on rock, playing lyre set on his left knee. Ground line.','from CN'),(65,'Nackter Apollon nach links stehend, in der vorgestreckten Rechten Patera, in der Linken Bogen haltend.','Nude Apollo standing left, holding patera in outstretched right hand and bow in left hand.','from CN'),(66,'Nackter Apollon mit Lorbeerkranz nach rechts stehend, die Rechte in die Hüfte gestemmt, die Linke auf eine vor ihm stehende niedrige, bekränzte Säule stützend.','Nude laureate Apollo standing right, resting right hand on hip, left resting on short garlanded column.','from CN'),(67,'Apollon und Artemis vor einer großen Fackel; links Apollon nach rechts stehend, von hinten gesehen, über der linken Schulter Chlamys, in der Linken Speer schulternd; rechts Artemis stehend von vorn, Kopf nach links, in kurzem Chiton und in hohen Stiefeln, in der Linken Bogen.','Apollo and Artemis in front of large conical torch; to left, Apollo standing right, seen from behind, holding spear in left arm and chlamys over left shoulder clasping right hands with Artemis, to right, standing left, wearing a short chiton and boots, holding a bow in left hand.','from CN'),(69,'Nackter Apollon stehend von vorn, Kopf nach rechts, auf seinem Rücken herabhängende Chalmys, in der Rechten den Riemen eines Köchers, in der vorgestreckten Linken Pfeil und Bogen haltend.','Nude Apollo standing facing, head right, wearing chlamys, holding strap of the quiver in right hand and arrow and bow in left hand.','from CN'),(76,'Apollon stehend von vorn, Kopf nach rechts, die Rechte über den Kopf und in der Linken die Lyra auf einem Dreifuß haltend.','Apollo standing facing, head right, raising right arm above head, holding lyre set on tripod with left hand.','from CN'),(77,'Apollon im langen Gewand stehend von vorn, Kopf nach links, in der vorgestreckten Rechten einen Lorbeerzweig haltend, in der Linken die Lyra auf einer links neben ihm stehenden, niedrigen Säule festhaltend.','Apollo standing facing, head left, wearing long garment, holding laurel-branch in outstretched right hand and lyre with left hand on a short column to his left.','from CN'),(79,'Nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach rechts, in der gesenkten Rechten Plektron, in der Linken die auf dem Dreifuß stehende Lyra haltend; um den Dreifuß windet sich eine Schlange. Bildleiste. Perlkreis.','Nude Apollo standing facing, head right, holding plectrum in right hand and in left arm lyre which rests on tripod; tripod entwined by serpent. Ground line. Border of dots.','from CN'),(80,'Apollon (Bonus Eventus) stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über flammenden Altar und in der Linken Lorbeerzweig haltend.','Apollo (Bonus Eventus) standing facing, head left, holding patera in outstretched right hand over lighted altar and laurel-branch in left hand.','from CN'),(82,'Nackter Apollon nach links stehend, in der vorgestreckten Rechten Patera über Altar und in der Linken Lorbeerzweig haltend.','Nude Apollo standing left, holding patera in outstretched right hand over altar and laurel-branch in left hand.','from CN'),(83,'Nackter Apollon stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über Altar und in der gesenkten Linken Lorbeerzweig haltend.','Nude Apollo standing facing, head left, holding patera in outstretched right hand over altar and laurel-branch in lowered left hand.','from CN'),(85,'Nackter Apollon stehend von vorn, Kopf nach links, das linke Bein über das rechte gekreuzt, in der vorgestreckten Rechten Patera haltend, die Linke über den Kopf einer sich um den Omphalos ringelnden Schlange vorgestreckt. Perlkreis.','Nude Apollo standing facing, head left, left leg crossed over right, holding patera in outstretched right hand, left hand over serpent coiling around omphalos at his feet to right. Border of dots.','from CN'),(86,'Nackter Apollon stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera, in der gesenkten Linken einen Lorbeerzweig nach unten haltend. Bildleiste. Perlkreis.','Nude Apollo standing facing, head left, holding patera in outstretched right hand and laurel-branch in left hand. Border of dots.','from CN'),(88,'Nackter Apollon stehend von vorn, Kopf nach links, in der Rechten Lorbeerzweig und in der Linken Bogen haltend.','Nude Apollo standing facing, head left, holding laurel-branch in right hand and bow in left.','from CN'),(93,'Triumphbogen geschmückt mit einer Girlande. Auf dem Bogen Statuengruppe; in der Mitte Kaiser (Nero) in Quadriga von vorn; links Nike stehend von vorn mit unklarem Gegenstand in der Rechten; rechts Pax stehend von vorn mit Füllhorn? in der Linken; auf den Säulen zu beiden Seiten des Bogens je ein Soldat; Mars in einer Nische links im Bogen.','Triumphal arch with garland between pillars surmounted by statuary group; emperor (Nero) in facing quadriga, escorted by Nike on left, standing facing, holding uncertain object in right hand and Pax on right, standing facing, holding cornucopia? in left arm; flanked by two soldiers on each column on both sides of the arch; Mars in niche on left side of arch.','from CN'),(97,'Nackter Ares stehend von vorn, Kopf nach rechts, mit Helm mit Helmbusch, in der Rechten nach unten gerichteten Speer und in der Linken Parazonium haltend.','Nude Ares standing facing, head right, wearing crested helmet, holding inverted spear in right hand and parazonium in left arm.','from CN'),(98,'Ares stehend von vorn, Kopf nach rechts, mit Panzer, Helm mit Helmbusch und in Stiefeln, Speer in der Rechten, Parazonium in der Linken haltend.','Ares standing facing, head right, wearing cuirass, boots and crested helmet, holding spear in right hand and parazonium in left hand.','from CN'),(100,'Nackter Ares stehend von vorn, Kopf nach rechts, in der Rechten den gesenkten Speer, in der Linken den Bogen, über dem linken Arm Chlamys.','Nude Ares standing facing, head right, wearing helmet, holding spear in right hand, bow in left hand.','from CN'),(101,'Artemis im kurzen Chiton und in Stiefeln, nach rechts schreitend, Kopf nach links, in der vorgestreckten Linken Bogen, in der Rechten Pfeil aus dem Köcher am Rücken ziehend. Bildleiste.','Artemis advancing right, head left, wearing short chiton and boots, holding bow in left hand, drawing arrow with right hand from quiver at shoulder. Ground line.','from CN'),(102,'Artemis im kurzen Chiton und in Stiefeln, nach rechts schreitend, in der vorgestreckten Linken Bogen, in der Rechten Pfeil aus dem Köcher am Rücken ziehend.','Artemis advancing right, wearing short chiton and boots, holding bow in left hand, drawing arrow with right hand from quiver at shoulder.','from CN'),(103,'Artemis im kurzen, wehenden Chiton und in Stiefeln, nach rechts stehend, in der vorgestreckten Linken Bogen, in der Rechten einen Pfeil aus dem Köcher am Rücken ziehend. Perlkreis.','Artemis standing right, wearing short fluttering chiton and boots, holding bow in left hand and drawing arrow from quiver at shoulder with right hand. Border of dots.','from CN'),(104,'Artemis im kurzen, wehenden Chiton und in Stiefeln, nach rechts schreitend, in der vorgestreckten Linken Bogen, in der Rechten einen Pfeil aus dem Köcher am Rücken ziehend; zu ihren Füßen Hund nach rechts laufend.','Artemis advancing right, wearing short fluttering chiton and boots, holding bow in left hand and drawing arrow from quiver at shoulder with right hand; at her feet, hound running right.','from CN'),(105,'Artemis (Tauropolos), die Haare am Hinterkopf gebunden, im kurzen Chiton, mit wehendem Mantel und in Stiefeln, nach rechts schreitend, in jeder Hand eine kurze Fackel fast waagerecht haltend. Kurze Bildleiste. Perlkreis.','Artemis (Tauropolos) advancing right, hair bound at her neck, wearing short chiton, cloak and boots, holding almost horizontally a torch in each hand. Short ground line. Border of dots.','from CN'),(106,'Artemis im langen Gewand nach links schreitend, in jeder Hand eine kurze Fackel nach oben haltend.','Artemis advancing left, wearing long garment, holding in each hand short torch upwards.','from CN'),(107,'Artemis im kurzen Chiton und in Stiefeln nach rechts schreitend, in jeder Hand eine kurze Fackel. Bildleiste.','Artemis advancing right, wearing a short chiton and boots, holding short torch in each hand. Ground line.','from CN'),(108,'Brustbild von Artemis nach rechts, mit Diadem und Gewand, Bogen und Köcher am Rücken.','Diademed and draped bust of Artemis, right, bow and quiver at shoulder.','from CN'),(109,'Brustbild der Artemis nach rechts mit straff hochgekämmtem Haar und Gewand; vor ihr Bogen; hinter ihr Köcher.','Draped bust of Artemis, right, wearing hair knot; in front of her bow; behind her quiver.','from CN'),(110,'Artemis im langen Gewand nach rechts stehend, in der gesenkten Rechten zwei Pfeile, in der vorgestreckten Linken den Bogen haltend.','Artemis standing right, wearing long garment, holding two arrows in right hand and bow in left hand.','from CN'),(111,'Artemis im kurzen Chiton und in Stiefeln stehend von vorn, Kopf nach rechts, im rechten Arm eine Fackel, in der vorgestrecken Linken den Bogen haltend; zu ihren Füßen Hund nach rechts, zu ihr aufblickend. Perlkreis.','Artemis standing facing, head right, wearing long garment and boots, holding short torch in right hand and bow in left hand; at her feet, hound, right, looking upwards to her. Border of dots.','from CN'),(112,'Artemis 