ak.','from CN'),(618,'Greif nach links sitzend, die rechte Vordertatze erhoben, mit Federflügeln, geschwungenem Schwanz und geschlossenem Schnabel.','Griffin seated left, right forepaw raised, with feathered wings, tail curling and closed beak.','from CN'),(619,'Greif nach links sitzend, die rechte Vordertatze erhoben, mit runden, aufgerichteten Palmettenflügeln, geschwungenem Schwanz und geöffnetem Schnabel, die Zunge hervorgestreckt.','Griffin seated left, right forepaw raised, with palmette-like curved upwards wings, tail curling and open beak with tongue protruding.','from CN'),(620,'Greif nach links sitzend, die rechte Vordertatze erhoben, mit einfach gebogenen Flügeln, geschwungenem Schwanz und geöffnetem Schnabel, die Zunge hervorgestreckt.','Griffin seated left, right forepaw raised, with plain curved wings, tail curling and open beak with tongue protruding.','from CN'),(621,'Greif nach links auf Thunfisch sitzend, die rechte Vordertatze erhoben, den runden Palmettenflügel aufgerichtet, mit geöffnetem Schnabel, die Zunge hervorgestreckt. Perlkreis.','Griffin seated left on tunny, left, right forepaw raised, with palmette-like upwards curved wings, tail curling and open beak with tongue protruding.','from CN'),(622,'Greif nach links sitzend, die rechte Vordertatze erhoben, mit runden, aufgerichteten Palmettenflügeln, geschwungenem Schwanz und geöffnetem Schnabel, die Zunge hervorgestreckt; davor Zikade nach unten. Perlkreis.','Griffin seated left, right forepaw raised, with palmette-like curved upwards wings, tail curling and open beak with tongue protruding; to left, cicada downwards. Border of dots.','from CN'),(623,'Greif nach links sitzend, mit Federflügeln, hinterer Flügel im Hintergrund sichtbar, mit geschwungenem Schwanz und geschlossenem Schnabel; links davon Fliege. Perlkreis.','Griffin seated left, with feathered wings, second wing to be seen in background, with tail curling and closed beak; to left, fly. Border of dots.','from CN'),(624,'Greif nach