ra mit Stephane und Schleier stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über flammenden und bekränzten Altar haltend, die Linke auf das lange Zepter gestützt. Bildleiste. Perlkreis.','Veiled Hera standing facing, head left, wearing stephane, holding patera in outstretched right hand over lighted and garlanded altar, left resting on long sceptre. Ground line. Border of dots.','from CN'),(642,'Hera im langen Gewand nach links stehend, in der vorgestreckten Rechten Patera haltend, die Linke auf das Zepter gestützt. Bildleiste. Perlkreis.','Hera standing facing, head left, holding patera in outstretched right hand, left resting on sceptre. Ground line. Border of dots.','from CN'),(643,'Hera mit Stephane, Schleier und im langen Gewand stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera haltend, die Linke auf das lange Zepter gestützt. Kurze Bildleiste. Perlkreis.','Veiled Hera standing facing, head left, wearing stephane and long garment, holding patera in outstretched right hand, left resting on long sceptre. Ground line. Border of dots.','from CN'),(644,'Statue der Hera (Samios) mit Kalathos und Schleier nach links stehend, in den vorgestreckten Händen herabhängende punktierte Bandschleifen haltend.','Veiled Hera (Samios) standing left, wearing kalathos, resting both hands on pelleted fillets.','from CN'),(645,'Nackter, bärtiger Herakles nach rechts schreitend, Kopf nach links, das Löwenfell über der linken Schulter, in der Linken die Keule schulternd; in der Rechten Kerberos an der Kette hinter sich herführend, der hinter einem Fels erscheint.','Nude bearded Heracles advancing right, head left, lion skin over left shoulder, holding club with left hand over left shoulder, drawing out Cerberus on a leash, outcropping behind a rock to left.','from CN'),(646,'Nackter, bärtiger Herakles mit dem linken Bein nach rechts schreitend, in der rückwärts erhobenen Rechten die Keule, in der vorgestreckten Linken den Bogen, Löwenfell 