back and grasping it by the antlers. Border of dots.','from CN'),(657,'Nackter Herakles nach rechts stehend, das Löwenfell über Kopf und Schulter, die nach rechts fliehende Kerynitische Hirschkuh in beiden Händen am Geweih packend und mit dem rechten Knie zu Boden drückend. Bildleiste. Perlkreis.','Nude Heracles standing right, wearing lion skin, pushing Cerynean hind with his right knee at its back and grasping it by the antlers. Ground line. Border of dots.','from CN'),(658,'Nackter bärtiger Herakles, nach rechts schreitend, Löwenfell über dem linken Arm, den emporsteigenden Kretischen Stier mit der erhobenen Rechten am linken Horn packend und mit der Linken am Hals würgend.','Nude Heracles advancing right, lion skin over left arm, grasping with right hand the horns of the uprising Cretan Bull, strangling it with left arm.','from CN'),(660,'Herakles mit Diomedes und Pferden; in der Mitte Herakles nach links stehend, Kopf nach rechts, in der erhobenen Rechten die Keule schwingend, in der Linken den auf seinen Knien nach rechts gefallenen Diomedes am Kopf packend; links von ihm Pferd nach rechts galoppierend; darunter Rad; rechts von ihm drei Pferde nach rechts, das unterste gefallen, das oberste nach rechts springend.','Heracles with Diomedes and horses; in the middle, Heracles standing left, head right, brandishing club in raised right hand and grasping Diomedes, fallen on his knees to right, by the head with left hand; to left, horse running right, below, wheel; to right, three horses to right, lowest one fallen, upper one pouncing right.','from CN'),(661,'Nackter Herakles stehend von vorn, Kopf nach rechts, die Keule in der rechten Hand haltend, Löwenfell über dem linken Arm; rechts von ihm, Apfelbaum der Hesperiden, um den sich eine Schlange (Ladon) windet.','Nude Heracles standing facing, head right, holding club in right hand and lion skin over his left arm; at right, serpent (Ladon) coiling around apple tree of the Hesperides.','from CN'),(662,'Nackter, bärtiger Herakles stehend von vorn, Kopf nach rechts, das Löwenfell über der linken Schulter, den rechten Arm auf die gesenkte Keule gestützt, in der Linken die Äpfel der Hesperiden; rechts neben ihm, der Baum der Hesperiden, um den sich die Schlange (Ladon) windet, Kopf nach Iinks, rechts hinter dem Baum, eine Hesperide im langen Gewand stehend von vorn, Kopf nach links.','Nude bearded Heracles standing facing, head right, holding club in right hand, lion skin over left arm and apples of the Hesperides in left hand; at right, serpent (Ladon) coiling around tree, at right, Hesperide standing facing, head left.','from CN'),(663,'Nackter, bärtiger Herakles, nach rechts schreitend, mit der Rechten die Keule schwingend, mit der Linken Hippolyte am Schopf packend, die auf einem zusammenbrechenden Pferd nach rechts sitzt, Kopf nach links, in der Rechten sich vom Zugriff des Herakles zu befreien sucht und in der erhobenen Linken Schild hält; im Abschnitt, Doppelbeil nach links.','Heracles standing right, lion skin over left arm, holding club overhead in raised right hand and grasping with left hand Hippolyte by her hair, seated right, head left, on horse collapsing right; Hippolyte tries to ward off his left hand with her right and holds her shield in her raised left; in exergue, fallen double ax, left.','from CN'),(665,'Herakles mit Löwenfell nach links stehend, die Hydra, die sich um sein rechtes Bein ringelt, in der Linken fassend und mit der über seinen Kopf gehaltenen Keule in der Rechten zum Schlag ausholend.','Heracles standing left, wearing lion skin, grasping Hydra coiling around his right leg with left hand, about to strike with club in right hand over her head.','from CN'),(666,'Nackter Herakles nach links stehend, mit beiden Armen den ihn nach rechts anspringenden Nemeischen Löwen, Kopf nach links, würgend.','Nude Heracles standing left, strangling in both hands the attacking Nemean lion to right, head left.','from CN'),(667,'Nackter Herakles nach links stehend, mi