h within dotted linear square; below, in right field, cantharus; all within incuse square.','from CN'),(1648,'Nackter Triptolemos mit wehendem Mantel auf einer von zwei geflügelten Schlangen, mit Köpfen nach oben, nach rechts gezogenen Biga nach rechts stehend, die Rechte zur Schulter erhoben, die Linke nach vorn gesenkt.','Nude Triptolemos standing in biga, right, drawn by two winged serpents, heads up, wearing fluttering chlamys, holding seeds in chlamys with left hand, sowing with right hand.','from CN'),(1649,'Nackter jugendlicher Herakles nach links schreitend mit Löwenfell über der rechten Schulter, in der Linken die vor ihm stehende Hydra, von vorn, Kopf nach rechts, am linken Arm packend und die Keule in der Rechten über seinen Kopf bereit zum Schlag haltend. Bildleiste. Perlkreis.','Nude youthful Heracles standing left, wearing lion skin over right shoulder, grasping with left hand Hydra by her left arm, standing facing in front of him, head right; about to strike with club in right hand over her head. Ground line. Border of dots.','from CN'),(1650,'Nackter Apollon (Bonus Eventus) stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera und in der Linken Lorbeerzweig haltend. Bildleiste.','Nude Apollo (Bonus Eventus) standing facing, head left, holding patera in outstretched right hand and laurel-branch in left hand. Ground line.','from CN'),(1651,'Nackter bärtiger Herakles nach rechts schreitend, das Löwenfell über der linken Schulter, den Erymanthischen Eber auf der linken Schulter tragend; rechts vor ihm Pithos, darin der nackte Eurystheus nach links stehend, beide Hände flehend erhoben. Bildleiste. Perlkreis.','Nude bearded Heracles advancing right, lion skin over left shoulder, carying the Erymanthian Boar over left shoulder; at right, Eurystheus standing left in a pithos, begging with raised arms. Ground line. Border of dots.','from CN'),(1653,'Weintraube mit Blättern und Ranken im geperlten Linienquadrat; im Feld unten links, Kantharos