es Antoninus Pius nach rechts mit Lorbeerkranz und Paludamentum.','Laureate head of Antoninus Pius, right, wearing paludamentum.','from CN'),(1662,'Brustbild der Iulia Domna nach rechts mit Gewand, von vorn gesehen. Perlkreis.','Draped bust of Julia Domna, right, seen from front. Border of dots.','from CN'),(1663,'Nackter Herakles nach rechts stehend, den rechten Arm auf die Keule stützend, Löwenfell über dem linken Arm, im linken Arm einen Bogen haltend.','Nude Heracles standing right, resting right hand on club, lion skin over left arm, holding bow in left arm.','from CN'),(1664,'Weintraube mit Blättern und Ranken im geperlten Linienquadrat; im Feld unten links, Rhyton in Gestalt eines Hirschvorderteiles nach rechts; im quadratum incusum.','Bunch of grapes on vine branch within dotted linear square; in lower left field, rhyton in shape of deer to right; all within incuse square.','from CN'),(1666,'Homonoia mit Kalathos und im langen Gewand stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden und bekränzten Altar haltend, im linken Arm das Füllhorn; auf der Patera eine nach rechts fliegende Nike mit Lorbeerkranz in der erhobenen Rechten. Bildleiste. Perlkreis.','Homonoia standing facing, head left, wearing kalathos and long garment, holding patera in outstretched right hand over lighted and garlanded altar and cornucopia in left arm; on paterNike flying right, holding wreath in right hand. Ground line. Border of dots.','from CN'),(1667,'Demeter nach links thronend, in der Rechten zwei Ähren haltend, den linken Arm auf lange Fackel gestützt. Bildleiste.','Demeter enthroned left, holding two ears of corn in right hand, left resting on long torch. Ground line.','from CN'),(1668,'Brustbild des jugendlichen Caracalla nach rechts, von vorn gesehen, mit Panzer und Paludamentum. Perlkreis.','Bare-headed bust of youthful Caracalla, right, seen from front, wearing cuirass and paludamentum. Border of dots.','from CN'),(1669,'Poseidon mit nacktem Oberkörper nach rechts auf einem Felsen sitzend, in der vorgestreckten Rechten Fisch nach rechts haltend und mit der Linken auf dem linken Knie ruhenden Dreizack schulternd.','Poseidon seated right on rock, naked to waist, holding fish, right, in outstretched right hand and trident in left arm over his shoulder.','from CN'),(1671,'Kybele mit Mauerkrone nach links auf einem Thron (mit Löwenfüßen) sitzend, in der vorgestreckten Rechten Patera haltend und den linken Arm auf Tympanon stützend; zu ihren Füßen nach links liegender Löwe.','Turreted Cybele enthroned left (seat with lion feet), holding patera in outstretched right hand, left arm resting on tympanon; beside throne, lion lying to left.','from CN'),(1672,'Nackter jugendlicher Dionysos stehend von vorn, Kopf nach links, mit Efeukranz, die Nebris von der linken Schulter zur rechten Hüfte, in der Rechten den Kantharos, die Linke auf den mit Bandschleife geschmückten Thyrsos gestützt; zu seinen Füßen links, Panther mit erhobener Vorderpfote nach links sitzend, Kopf nach rechts. Bildleiste. Perlkreis.','Nude youthful Dionysus standing facing, head left, nebris over left shoulder to right hip, holding cantharus in right hand over panther seated left, head right, and filleted thyrsus in left arm. Ground line. Border of dots.','from CN'),(1673,'Brustbild des kurzbärtigen Caracalla nach rechts mit Lorbeerkranz, Panzer und Paludamentum. Perlkreis.','Laureate bust of lightly bearded Caracalla, right, wearing cuirass and paludamentum. Border of dots.','from CN'),(1674,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer und in Stiefelnstehend von vorn, Kopf nach links, in der Rechten Speer und in der Linken Parazonium haltend; hinter ihm Nike nach links stehend, den Kaiser mit einem Lorbeerkranz in der Rechten bekränzend, im linken Arm Palmzweig haltend. Bildleiste. Perlkreis.','Emperor (Caracalla) in military attire standing facing, head left, wearing cuirass and boots, holding spear in right hand and parazonium in left hand; behind him, Nike standing left, crowning emperor with laurel wreath in left hand, holding palm branch in left arm. Ground line. Border of dots.','from CN'),(1675,'Dionysos mit Hörnern und wehender Chlamys auf einer nach rechts sprengenden Biga, in beiden Händen die Zügel; links neben ihm eine Mänade, rechts stehend und in beiden Händen den bogenförmig geblähten Schleier haltend. Bildleiste. Perlkreis.','Dionysus with horns and on left Maenad standing in galloping biga, right; Dionysos wearing fluttering chlamys, holding the reins in both hands; Maenad standing right, holding an expanded veil in both hands. Ground line. Border of dots.','from CN'),(1676,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord fünf Ruderer vor zwei Standarten.','Galley, under full sail, sailing right, in waters; on board, five rowers in front of two standards.','from CN'),(1678,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord vier Ruderer vor zwei Standarten.','Galley, under full sail, sailing right, in waters; on board, four rowers in front of two standards.','from CN'),(1679,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord fünf Ruderer und Steuermann.','Galley, under full sail, sailing right, in waters; on board, five rowers and helmsman.','from CN'),(1680,'Verzierte Preiskrone. Bildleiste. Perlkreis.','Prize crown, ornated. Border of dots. Ground line.','from CN'),(1682,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden und bekränzten Altar haltend, die Linke auf das Zepter gestützt. Bildleiste. Perlkreis.','Emperor (Caracalla) in military attire standing facing, head left, wearing cuirass, fluttering paludamentum and boots, holding patera in outstretched right hand over lighted and garlanded altar, left resting on sceptre. Ground line. Border of dots.','from CN'),(1683,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera haltend, die Linke auf das Zepter gestützt. Bildleiste. Perlkreis.','Emperor (Caracalla) in military attire standing facing, head left, wearing cuirass, fluttering paludamentum and boots, holding patera in outstretched right hand and sceptre in left hand. Ground line. Border of dots.','from CN'),(1684,'Poseidon mit nacktem Oberkörper nach links thronend, in der vorgestreckten Rechten Fisch nach links haltend und mit der Linken auf dem linken Knie ruhenden Dreizack schulternd.','Poseidon enthroned left, naked to waist, holding fish, left, in outstretched right hand and trident in left arm over his shoulder.','from CN'),(1685,'Artemis im kurzen Chiton und in Stiefeln stehend von vorn, Kopf nach rechts, in der vorgestreckten Linken den Bogen und im rechten Arm die Fackel, links hinter ihr nach links stehender Hund, Kopf nach rechts. Bildleiste. Perlkreis.','Artemis standing facing, head right, wearing long garment and boots, holding bow in left hand and short torch in right hand, at left side hound to left, head right. Ground line. Border of dots.','from CN'),(1686,'Nackter Athlet stehend von vorn, Kopf nach rechts, sich selbst mit der Rechten bekränzend und Palmzweig in der Linken haltend. Kurze Bildleiste. Perlkreis.','Nude athlete standing facing, head right, crowning himself with right hand, holding palm branch in left arm. Short ground line. Border of dots.','from CN'),(1687,'Tyche mit Mauerkrone, stehend von vorn, Kopf nach links, auf ihren vorgestreckten Händen je einen hexastylen Tempel haltend; zu ihren Füßen flammender Altar. Bildleiste. Perlkreis.','Turreted Tyche standing facing, head left, holding hexastyle temple in each outstretched hand; at her feet, lighted altar. Ground line. Border of dots.','from CN'),(1688,'Brustbild des bärtigen Caracalla nach rechts mit Lorbeerkranz, Panzer und Paludamentum; über der linken Schulter 