ead right, lion skin over shoulder, drawing arrow with right hand from quiver at back, holding bow in outstretched left hand; at right, three Stymphalian birds falling. Ground line. Border of dots.','from CN'),(1694,'Links, Demeter mit Ährenkranz und Schleier, stehend von vorn, Kopf nach rechts, die Linke auf die lange brennende Fackel gestützt, in der Rechten zwei Ähren haltend; links vor ihr nach rechts geöffnete cista mystica, aus der sich eine Schlange nach rechts ringelt; rechts, Homonoia mit Kalathos, stehend von vorn, Kopf nach links, im linken Arm das Füllhorn, in der vorgestreckten Rechten Patera über einen bekränzten flammenden Altar ausgießend. Bildleiste. Perlkreis.','At left, Demeter standing facing, head right, wearing wreath, holding long lit torch in left arm and two ears of corn with right hand over cista mystica on the left with half-open lid, to right, out of which serpent creeps, right; at right, Homonoia with kalathos standing facing, head left, holding a patera in outstretched right hand over lighted and garlanded altar to left and cornucopia in left arm. Ground line. Border of dots.','from CN'),(1695,'Kaiser (Caracalla) in Kriegsbekleidung mit Strahlenkrone und Paludamentum nach links in einer Quadriga, in der vorgestreckten Rechten Preiskrone, in der Linken Adlerzepter. Bildleiste. Perlkreis.','Radiate emperor (Caracalla) in military attire standing in quadriga, left, wearing paludamentum, holding prize crown in right hand and eagle-sceptre in left arm. Ground line. Border of dots.','from CN'),(1696,'Kaiser (Caracalla) in Kriegsbekleidung mit Strahlenkrone und Paludamentum nach rechts in einer Quadriga, in der vorgestreckten Rechten Preiskrone, in der Linken Adlerzepter. Bildleiste. Perlkreis.','Radiate emperor (Caracalla) in military attire standing in quadriga, right, wearing paludamentum, holding prize crown in right hand and eagle-sceptre in left arm. Ground line. Border of dots.','from CN'),(1697,'Kaiser (Caracalla) in Kriegsbekleidung m