sping right hands; each wearing toga, holding a scroll in left hand. Ground line. Border of dots.','from CN'),(1707,'Athena stehend von vorn, Kopf nach links, im langem Chiton und mit Helm, in der Rechten sich auf einem am Boden abgestellten Schild stützend, in der Linken langes Zepter haltend. Bildleiste. Perlkreis.','Athena standing facing, head left, wearing helmet and long garment, resting right hand on shield, holding long sceptre in left hand. Ground line. Border of dots.','from CN'),(1708,'Demeter mit Schleier stehend von vorn, Kopf nach rechts, die Rechte auf lange Fackel gestützt, in der erhobenen Linken Ähren haltend. Bildleiste. Perlkreis.','Veiled Demeter standing facing, head right, holding long torch in right arm and ears of corn in raised left hand. Ground line. Border of dots.','from CN'),(1709,'Nemesis (Dikaiosyne) stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Waage, im linken Arm das Füllhorn haltend. Perlkreis.','Nemesis (Aequitas) standing facing, head left, holding scales in outstretched right hand and cornucopia in left arm. Border of dots.','from CN'),(1710,'Tyche mit Mauerkrone, stehend von vorn, Kopf nach links, auf der vorgestreckten Rechten oktastylen Tempel und im linken Arm Füllhorn haltend. Perlkreis.','Turreted Tyche standing facing, head left, holding octastyle temple on outstretched right hand and in left arm cornucopia. Border of dots.','from CN'),(1711,'Artemis (Tauropolos) im kurzen Chiton, mit wehendem Mantel und in Stiefeln nach rechts schreitend, in jeder Hand eine kurze Fackel. Bildleiste. Perlkreis.','Artemis (Tauropolos) advancing right, wearing a short chiton, fluttering cloak and boots, holding short torch in each hand. Ground line. Border of dots.','from CN'),(1712,'Brustbild des bärtigen Geta nach rechts mit Lorbeerkranz, Panzer und Paludamentum; auf der Brust das Gorgoneion. Perlkreis.','Laureate bust of bearded Geta, right, wearing cuirass and paludamentum; on breastplate gorgoneion. Border of dots.','from CN'),(1714,'Nackter bärtiger Herakles nach rechts schreitend, das Löwenfell über der linken Schulter, den Erymanthischen Eber mit den Beinen nach oben auf der linken Schulter tragend, rechts vor ihm Pithos, darin der nackte Eurystheus nach links stehend, beide Hände flehend erhoben. Bildleiste. Perlkreis.','Nude bearded Heracles advancing right, lion skin over left shoulder, carying the Erymanthian Boar with legs upwards over left shoulder; at right, Eurystheus standing left in a pithos, begging with raised arms. Ground line. Border of dots.','from CN'),(1715,'Nackter, bärtiger Herakles nach rechts stehend und mit beiden Armen den ihn nach links anspringenden Nemeischen Löwen würgend. Bildleiste. Perlkreis.','Nude bearded Heracles standing right, strangling in both hands the attacking Nemean lion, left; in exergue, club. Ground line. Border of dots.','from CN'),(1716,'Nackter, bärtiger Herakles nach links schreitend, Löwenfell über dem Kopf, in der Rechten die Keule schwingend, in der Linken nach dem Mantel der Hippolyte greifend, die nach links mit erhobenen Händen kniet, Kopf nach rechts; im Feld links oben, Pferdekopf nach links. Bildleiste. Perlkreis.','Heracles standing right, wearing lion skin, holding club overhead in raised right hand and grasping with left hand Hippolyte\'s cloak, kneeling left, head right, raising both hands; in left upper field, horse head. Ground line. Border of dots.','from CN'),(1717,'Nackter, bärtiger Herakles stehend von vorn, Kopf nach links, im linken Arm Löwenfell und Keule und in der vorgestreckten Rechten Patera über einen bekränzten, mit Früchten belegten Altar haltend; über dem Altar Adler nach links fliegend, Kopf nach rechts. Bildleiste. Perlkreis.','Nude bearded Heracles standing facing, head left, holding lion skin and club in left arm and pater in right hand over garlanded, covered with fruits altar; eagle flying left over altar, head right. Ground line. Border of dots.','from CN'),(1718,'Brustbild des Elagabal nach rechts mit Strahlenkrone, Schuppenpanzer und Paludamentum. Perlkreis.','Radiate bust of Elagabalus, right, wearing scale cuirass and paludamentum. Border of dots.','from CN'),(1719,'Nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der gesenkten Rechten Lorbeerzweig über einen beschrifteten Altar haltend, sich mit der Linken auf den Dreifuß mit nach links windender Schlange stützend. Bildleiste. Perlkreis.','Nude Apollo standing facing, head left, holding laurel-branch in right hand over inscribed altar, leaning left arm on tripod with serpent coiling left. Ground line. Border of dots.','from CN'),(1720,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord sieben Ruderern und Steuermann. Perlkreis.','Galley, under full sail, sailing right, in waters; on board, seven rowers and helmsman. Border of dots.','from CN'),(1721,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord sechs Ruderer vor zwei Standarten. Perlkreis.','Galley, under full sail, sailing right, in waters; on board, six rowers in front of two standards. Border of dots.','from CN'),(1722,'Preistisch mit Löwenfüßen nach links, darauf zwei Preiskronen mit je einem Palmzweig; zwischen den Preiskronen Geldbörse; darunter fünf Äpfel und Amphora.','Agonistic table with lion legs, left, surmounted by prize crowns containing palm branch each and purse inbetween; below, five apples and amphora.','from CN'),(1723,'Kaiser (Elagabal) in Kriegsbekleidung mit Strahlenkrone, Panzer, wehendem Paludamentum und in Stiefeln, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über flammenden Altar haltend, die Linke auf das Zepter gestützt. Bildleiste. Perlkreis.','Radiate emperor (Elagabalus) in military attire standing facing, head left, wearing cuirass, fluttering paludamentum and boots, holding patera in outstretched right hand over lighted altar, left resting on sceptre. Ground line. Border of dots.','from CN'),(1724,'Kaiser (Elagabal) in Kriegsbekleidung mit Strahlenkrone, Panzer, wehendem Paludamentum und in Stiefeln, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera haltend, die Linke auf das Zepter gestützt. Bildleiste. Perlkreis.','Radiate emperor (Elagabalus) in military attire standing facing, head left, wearing cuirass, fluttering paludamentum and boots, holding patera in outstretched right hand, left resting on sceptre. Ground line. Border of dots.','from CN'),(1725,'Zwei hexastyle Tempel in perspektivischer Ansicht je auf Krepis sich gegenüberstehend mit je einem Schild im Giebel. Perlkreis.','Two hexastyle temples in perspective facing each other; both on crepidoma and with a shield on the pediment. Border of dots.','from CN'),(1726,'Athena stehend von vorn, Kopf nach links, im langem Chiton und mit Helm, in der vorgestreckten Rechten Patera, in der Linken Speer haltend und den Schild hinter ihr stützend. Perlkreis.','Athena standing facing, head left, wearing long garment and helmet, holding patera in outstretched right hand and spear in left arm; left hand on shield placed on ground behind. Border of dots.','from CN'),(1727,'Nackter Athlet stehend von vorn, Kopf nach rechts, die Haare am Hinterkopf zusammengebunden, in der Rechten den Palmzweig schulternd, in der gesenkten Linken Preiskrone haltend. Kurze Bildleiste. Perlkreis.','Nude athlete standing facing, head right, hair bound, holding palm branch over right shoulder with right hand and prize crown in left hand. Short ground line. Border of dots.','from CN'),(1728,'Nackter Athlet stehend von vorn, Kopf nach rechts, die Haare am Hinterkopf zusammengebunden, rechtes Bein vorgesetzt, mit der Rechten in die links neben ihm stehende Losurne greifend. Perlkreis.','Nude athlete standing facing, head right, hair bound, right foot advanced, placing right hand into a prize urn. Border of dots.','from CN'),(1729,'Nackter Athlet stehend von vorn, Kopf nach links, die Haare am Hinterkopf zusammengebunden, rechtes Bein vorgesetzt, mit der Rechten in die links neben ihm stehende Losurne greifend. Perlkreis.','Nude athlete standing facing, head left, hair bound, right foot advanced, placing right hand into a prize urn. Border of dots.','from CN'),(1730,'Nackter Athlet stehend von vorn, Kopf nach links, die Haare am Hinterkopf zusammengebunden, rechtes Bein vorgesetzt, in der Rechten die Loskugel, mit der Linken in die rechts neben ihm stehende Losurne greifend. Perlkreis.','Nude athlete standing facing, head left, hair bound, right foot advanced, holding draw lot in right hand, placing left hand into a prize urn to right. Border of dots.','from CN'),(1731,'Brustbild des Elagabal nach links mit Lorbeerkranz, Panzer und Paludamentum, in der Rechten Speer und am linken Arm den Schild. Perlkreis.','Laureate bust of Elagabalus, right, wearing cuirass and paludamentum, holding spear in right hand and shield at left shoulder. Border of dots.','from CN'),(1732,'Nackter bärtiger Herakles nach links schreitend, in der erhobenen Rechten die Keule, Löwenfell über dem linken Arm; zwei nach links springende Rinder vor sich hertreibend. Bildleiste. Perlkreis.','Nude bearded Heracles advancing left, in raised right hand club, lion skin over left arm; floating two cattle, leaping left. Ground line. Border of dots.','from CN'),(1733,'Zwei oktastyle Tempel in perspektivischer Ansicht je auf Krepis sich gegenüberstehend; darüber zwei Preiskronen, in jeder zwei Palmzweige. Perlkreis.','Two octastyle temples in perspective facing each other; both on crepidoma; above, two prize urns, each containing two palm branches. Border of dots.','from CN'),(1734,'Demeter und Homonoia, einander über einem flammenden und bekränzten Altar die Rechte reichend; Links Demeter mit Ährenkranz und Schleier nach rechts stehend, die Linke auf die lange Fackel gestützt; rechts Homonoia mit Kalathos stehend von vorn, Kopf nach links, im linken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Demeter and Homonoia, clasping right hands over lighted and garlanded altar; to left, veiled Demeter standing right, wearing corn wreath; to right, Homonoia standing facing, head left, wearing kalathos, holding cornucopia in left arm. Ground line. Border of dots.','from CN'),(1735,'Kaiser (Elagabal) mit Strahlenkrone und Toga nach rechts in einer Quadriga, in der Rechten Aphlaston in der Linken Zepter haltend; davor Wagenlenker nach rechts sitzend; hinten auf dem Wagenkasten Nike nach rechts stehend, den Kaiser bekränzend und im linken Arm Palmzweig haltend; im Hintergrund erhöhte Estrade, worauf zwei Gefangene mit phrygischer Mütze links und rechts sitzen, zwischen ihnen ein Tropaion. Bildleiste. Perlkreis.','Radiate and togate emperor (Elagabalus) standing in quadriga, right, wearing toga, holding an aplustre in right hand and sceptre in left arm; in front, charioteer seated right; behind, Nike standing right on chariot basket, crowning emperor with laurel wreath, holding palm branch in left arm; in background, trophy on dais, on each side a captive seated right and left. Ground line. Border of dots.','from CN'),(1736,'Tyche mit Mauerkrone nach links thronend, auf ihren geöffneten Händen je ein oktastyler Tempel. Bildleiste. Perlkreis.','Turreted Tyche enthroned left, holding an octastyle temple in each hand. Ground line. Border of dots.','from CN'),(1737,'Nackter, bärtiger Herakles stehend von vorn, Kopf nach rechts, Löwenfell über dem linken Arm, den rechten Arm auf der Keule; rechts, Apfelbaum der Hesperiden, um den sich eine Schlange (Ladon) windet; im Feld oben, Mondsichel nach links. Bildleiste. Perlkreis.','Nude bearded Heracles standing facing, head right, lion skin over his left arm, resting right hand on club; at right, serpent (Ladon) coiling around apple tree of the Hesperides; in field above, crescent to left. Ground line. Border of dots.','from CN'),(1738,'Nackter, bärtiger Herakles stehend von vorn, Kopf nach links, im linken Arm Löwenfell und Keule und in der vorgestreckten Rechten Patera über einen flammenden und bekränzten Altar haltend; über dem Altar Adler nach links fliegend, Kopf nach rechts. Bildleiste. Perlkreis.','Nude bearded Heracles standing facing, head left, holding lion skin and club in left arm and patera in outstretched right hand over lighted and garlanded altar; eagle flying left over altar, head right. Ground line. Border of dots.','from CN'),(1739,'Nemesis (Dikaiosyne) stehend von vorn, Kopf nach links, in der Rechten Waage und in der gesenkten Linken die Zügel haltend; zu ihren Füßen Rad. Perlkreis.','Nemesis (Aequitas) standing facing, head left, holding scales in right hand and reins in left hand; at her feet, wheel. Border of dots.','from CN'),(1740,'Preistisch nach rechts, darauf zwei Preiskronen, die linke mit Geldbörse, die rechte mit fünf Äpfeln; darunter Amphora. Perlkreis.','Agonistic table, right, surmounted by two prize crowns, left one with purse, right one with five apples; below, amphora. Border of dots.','from CN'),(1741,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord neun Ruderer und Steuermann vor zwei Standarten. Perlkreis.','Galley, under full sail, sailing right, in waters; on board, nine rowers and helmsman in front of two standards. Border of dots.','from CN'),(1743,'Kaiser (Severus Alexander) in Kriegsbekleidung mit Panzer und Paludamentum, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden Altar haltend, die Linke auf das Zepter gestützt.','Emperor (Severus Alexander) in military attire standing facing, head left, wearing cuirass and paludamentum, holding patera in outstretched right hand over lighted altar, left resting on sceptre.','from CN'),(1744,'Athena stehend von vorn, Kopf nach rechts, im langen Gewand und mit Mantel und Helm, in der Rechten Zepter, in der Linken Patera haltend; vor ihr Schild.','Athena standing facing, head right, wearing long garment, cloak and helmet, holding long sceptre in right arm and patera in outstretched left hand; at her feet, shield placed on ground.','from CN'),(1745,'Homonoia mit Kalathos stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden und bekränzten Altar haltend, im linken Arm das Füllhorn haltend; hinter ihr Elefantenzahn. Perlkreis.','Homonoia standing facing, head left, holding patera in outstretched right hand over lighted and garlanded altar and cornucopia in left arm; behind her elephant tusk. Border of dots.','from CN'),(1746,'Oktastyler Tempel in Perspektive nach links, mit Punkt im Giebel.','Octastyle temple in perspective, left; in pediment dot.','from CN'),(1749,'Nackter Athlet nach links schreitend, Kopf nach rechts, die Haare am Hinterkopf zusammengebunden, in der vorgestreckten Rechten Kranz und in der Linken Palmzweig haltend. Kurze Bildleiste. Perlkreis.','Nude athlete advancing left, head right, hair bound, holding wreath in outstretched right hand and palm branch in left arm. Short ground line. Border of dots.','from CN'),(1750,'Brustbild des Serapis nach rechts mit Kalathos und Gewand. Perlkreis.','Draped bust of Serapis, right, wearing kalathos. Border of dots.','from CN'),(1751,'Isis (Pharia) nach rechts schreitend, mit beiden Händen und ihrem linken Fuß das geblähte Segel haltend. Bildleiste.','Isis (Pharia) advancing right, holding sail with both hands and with left foot. Ground line.','from CN'),(1752,'Isis stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Sistrum und in der Linken Situla haltend.','Isis standing facing, head left, holding sistrum in outstretched right hand and situla in left hand.','from CN'),(1754,'Geschlossenes Stadttor, flankiert von zwei Türmen; darüber sechsbögige Galerie.','Closed city gate, flanked by two round towers; above, gallery of six arches.','from CN'),(1755,'Brustbild des jugendlichen Severus Alexander nach rechts, von vorn gesehen, mit Lorbeerkranz, Panzer und Paludamentum. Perlkreis.','Laureate bust of youthful Severus Alexander, right, seen from front, wearing cuirass and paludamentum. Border of dots.','from CN'),(1756,'Brustbild des leichtbärtigen Commodus nach rechts mit Lorbeerkranz, Schuppenpanzer und Paludamentum.','Laureate bust of Commodus, right, wearing scale cuirass and paludamentum.','from CN'),(1757,'Brustbild des bärtigen Severus Alexander nach rechts, von vorn gesehen, mit Lorbeerkranz, Panzer und Paludamentum; über der linken Schulter die Ägis, auf der Brustplatte das Gorgoneion. Perlkreis.','Laureate bust of Severus Alexander, right, seen from front, wearing cuirass and paludamentum; with aegis on left shoulder, gorgoneion on breastplate. Border of dots.','from CN'),(1759,'Kaiser (Commodus) mit wehendem Paludamentum nach rechts auf einem Pferd reitend, in der Linken Speer haltend. Bildleiste.','Emperor (Commodus) riding horse galloping right, wearing fluttering paludamentum, holding spear in left hand. Ground line.','from CN'),(1760,'Tyche mit Mauerkrone, stehend von vorn, Kopf nach links, auf der vorgestreckten Rechten Tempel; im linken Arm das Füllhorn mit Tempel darauf; zu ihren Füßen Preiskrone, darauf eine Geldbörse und rechts eine zweite, darauf fünf Äpfel. Bildleiste. Perlkreis.','Turreted Tyche standing facing, head left, holding temple on outstretched right hand; in left arm cornucopia thereon temple; at her feet, prize crown thereon a purse and at right, a second with five apples on it. Ground line. Border of dots.','from CN'),(1761,'Kaiser (Severus Alexander) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln nach rechts auf einem mit einem Pantherfell bedeckten Pferd reitend, in der gesenkten Rechten Speer den schräg nach unten gerichteten Speer gegen einen nach links sitzenden Gefangenen mit phrygischer Mütze und hinter dem Rücken gefesselten Händen schleudernd.','Emperor (Severus Alexander) in military attire riding right on horseback, covered with panther fur, wearing cuirass, fluttering paludamentum and boots, holding transverse spear in lowered right hand towards a captive in front of him seated left with Phrygian cap and bound arms behind back.','from CN'),(1762,'Kaiser (Severus Alexander) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln nach rechts auf einem mit einem Pantherfell bedeckten Pferd reitend, in der Rechten Speer den schräg nach unten gerichteten Speer haltend.','Emperor (Severus Alexander) in military attire riding right on horseback, covered with panther fur, wearing cuirass, fluttering paludamentum and boots, holding transverse spear in right hand.','from CN'),(1763,'Kaiser (Severus Alexander) mit Lorbeerkranz und in Toga, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden Dreifuß haltend und in der Linken eine kleine Rolle haltend. Bildleiste. Perlkreis.','Laureate and togate emperor (Severus Alexander) standing facing, head left, holding patera in outstretched right hand over lighted tripod, and a small scroll in left hand. Ground line. Border of dots.','from CN'),(1764,'Nackter jugendlicher Heros von Perinth mit Chlamys über der linken Schulter, nach rechts stehend, von hinten gesehen; rechts, nackter, bartloser Herakles nach links stehend, Löwenfell über dem linken Arm, die Linke auf die gesenkte Keule gestützt, einander die Rechte reichend. Bildleiste Perlkreis.','On left, nude youthful Heros of Perinthus standing right, seen from behind, wearing chlamys over left shoulder, clasping right hands with Heracles standing left, lion skin over left arm, holding club in left hand. Ground line. Border of dots.','from CN'),(1765,'Ariadne und Dionysos; im Vordergrund auf einem Felsen die schlafende Ariadne im Doppelchiton und Mantel nach links liegend, von vorn gesehen, die Arme unter dem Kopf verschränk; zu ihren Füßen Hund nach links liegend, Kopf nach rechts; in der Mitte Dionysos mit Efeukranz, das Pantherfell über der Schulter, stehend von vorn und auf die vor ihm liegende Ariadne herabblickend, den rechten Arm auf den Thyrsos gestützt, die Linke auf der Schulter eines Silens rechts neben ihm, stehend von vorn und zu Dionysos aufblickend, mit seiner Rechten auf die Schlafende zeigend; rechts von ihm ein zweiter Silenmit einem Fell über der Schulter, stehend von vorn, beide Hände ausgebreitet; links neben Dionysos ein gehörnter, bocksbeiniger Pan von vorn, springend, in der Linken das Pedum, den rechten Arm auf der Schulter des Silenos, nach rechts stehend, beide Hände auf einen Stock gestützt. Perlkreis.','Ariadne and Dionysus; in the front, Ariadne lying left on rock, sleeping with arms behind her head, wearing double chiton, seen from front; at her feet, dog lying left, head right; in the middle, Dionysus standing facing, wearing ivy wreath and nebris over shoulder, holding thyrsus in right hand; left hand over the shoulder of a Silenus, standing facing, pointing at Ariadne with right hand; to right, a second Silenus standing facing, extending hands; to left, horned Pan with goat-legs, bouncing, holding a pedum in left hand,right hand on the shoulder of a silen, standing right, resting both hands on a stock. Border of dots.','from CN'),(1766,'Nemesis (Nike) stehend von vorn, Kopf nach links, die Rechte vor der Brust, im linken Arm den Palmzweig; zu ihren Füßen Rad.','Nemesis (Nike) standing facing, head left, right hand in front of her chest; holding palm branch in left arm; at her feet, wheel.','from CN'),(1767,'Athena mit Helm, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden und bekränzten Altar, in der Linken Speer und Schild haltend. Bildleiste. Perlkreis.','Athena standing facing, head left, wearing helmet, holding patera in outstretched right hand over lighted and garlanded altar and spear with shield in left arm. Ground line. Border of dots.','from CN'),(1768,'Geschlossenes Stadttor, flankiert von zwei runden Türmen; darüber fünfbögige Galerie.','Closed city gate, flanked by two round towers; above door gallery of five arches.','from CN'),(1769,'Nackter Apollon nach rechts auf Fels sitzend, Lyra in beiden Händen haltend, auf das linke Knie gestellt. Bildleiste.','Nude Apollo seated right on rock, holding lyre in both hands. Ground line.','from CN'),(1770,'Brustbild des bärtigen Lucius Verus nach rechts mit Panzer und Paludamentum. Perlkreis.','Bust of bearded Lucius Verus, right, wearing cuirass and paludamentum. Border of dots.','from CN'),(1772,'Brustbild des Gordian III. nach rechts mit Strahlenkrone, Panzer und Paludamentum. Perlkreis.','Radiate bust of Gordian III, right, wearing cuirass and paludamentum. Border of dots.','from CN'),(1773,'Brustbild des bärtigen Commodus mit Lorbeerkranz nach rechts.','Laureate bust of bearded Commodus, right.','from CN'),(1774,'Kybele mit Mauerkrone nach links auf einem nach rechts schreitenden Löwen sitzend, den rechten Arm auf dem Tympanon, im linken Arm Zepter haltend.','Turreted Cybele seated left, on lion stepping right, holding tympanum in right hand, left resting on long sceptre.','from CN'),(1775,'Nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der gesenkten Rechten Lorbeerzweig über einen bekränzten und mit fünf Äpfeln belegten Altar haltend, sich mit der Linken auf den Dreifuß mit nach links windender Schlange stützend. Bildleiste. Perlkreis.','Nude Apollo standing facing, head left, holding laurel-branch in right hand over garlanded altar, which is covered with five apples, leaning left arm on tripod with serpent coiling left. Ground line. Border of dots.','from CN'),(1776,'Kybele mit Mauerkrone auf dem nach rechts springenden Löwen sitzend, nach rechts blickend, den rechten Arm auf dem Tympanon, im linken Arm Zepter haltend.','Turreted Cybele seated, head right, on lion jumping right, holding tympanum in right hand, left resting on long sceptre.','from CN'),(1777,'Demeter mit Schleier von vorn, zwei Fackeln haltend.','Veiled Demeter standing facing, holding two torches.','from CN'),(1778,'Demeter mit Schleier und im langen Gewand stehend von vorn, Kopf nach links, in der gesenkten Rechten zwei Ähren, die Linke auf das Zepter gestützt, um das sich, um das sich eine Schlange windet.','Veiled Demeter standing facing, head left, wearing corn wreath and long garment, holding two ears of corn in lowered right hand and sceptre entwined by serpent in left arm.','from CN'),(1779,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord acht Ruderer und Steuermann vor zwei Standarten; rechts Delphin nach rechts schwimmend. Perlkreis.','Galley, under full sail, sailing right, in waters; on board, eight rowers and helmsman in front of two standards; to right, dolphin swimming right. Border of dots.','from CN'),(1780,'Nike mit nacktem Oberkörper nach rechts stehend, den linken Fuß auf einen am Boden liegenden Helm setzend; mit der Linken den Schild an einer Säule festhaltend und mit der Rechten darauf schreibend. Bildleiste. Perlkreis.','Nike standing right, naked to waist, stepping with left foot on helmet; supporting shield on column with left hand, inscribing it with right hand. Ground line. Border of dots.','from CN'),(1782,'Nemesis stehend von vorn, Kopf nach links, den rechten Zeigefinger an die Lippen führend, in der gesenkten Linken die Zügel; zu ihren Füßen Rad.','Nemesis standing facing, head left, right finger at her mouth, holding reins in left hand; at her feet, wheel.','from CN'),(1783,'Nackter Ares stehend von vorn, Kopf nach links, mit Helm mit Helmbusch, unidentifizierbarer Gegenstand in der Rechten; am linken Arm den Schild. Perlkreis.','Nude Ares standing facing, head left, wearing crested helmet, holding an unidentified object in right hand; at left shoulder shield. Border of dots.','from CN'),(1784,'Nackter Apollon stehend von vorn, Kopf nach links, in der gesenkten Rechten Zweig über einen flammenden Altar haltend, sich mit der Linken auf Leier stützend, die auf Säule steht.','Nude Apollo standing facing, head left, holding branch in right hand over lighted altar, leaning left arm on lyre standing on column.','from CN'),(1785,'Nackter Apollon stehend von vorn, Kopf nach links, in der gesenkten Rechten Zweig haltend, sich mit der Linken auf Leier stützend, die auf Säule steht.','Nude Apollo standing facing, head left, holding branch in right hand, leaning left arm on lyre standing on short column.','from CN'),(1786,'Nackter Ares von vorn, Kopf nach links mit Helm, Rechte herabhängend, in der Linken Speer haltend, Schild am linken Arm.','Nude Ares standing facing, head left, wearing crested helmet, holding right arm down and spear in left arm with a shield.','from CN'),(1787,'Asklepios stehend von vorn, Kopf nach rechts, den rechten Arm am Rücken, im linken Arm den Schlangenstab haltend und darauf sein Kinn abstützend; in der Linken Schriftrolle haltend. Perlkreis.','Asclepius standing facing, head right, right hand on his back, holding serpent-staff in left arm and a scroll in left hand; chin resting on serpent-staff. Border of dots.','from CN'),(1789,'Brustbild der Faustina II. nach rechts mit Perlband und Gewand  das Haar im Nacken geknotet. Perlkreis.','Draped bust of Faustina II, right, wearing beaded ribbon and hair knot. Border of dots.','from CN'),(1790,'Hera mit Schleier und langem Gewand stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera haltend, die Linke auf das Zepter gestützt. Bildleiste. Perlkreis.','Veiled Hera standing facing, head left, wearing long garment, holding patera in outstretched right hand, left resting on sceptre. Ground line. Border of dots.','from CN'),(1792,'Tyche mit Kalathos nach links auf Felsen sitzend, in der Rechten Steuerruder haltend, die Linke auf den Sitz gestützt. Perlkreis.','Tyche seated left on rock, wearing kalathos, holding rudder in right hand, resting left arm on rock. Border of dots.','from CN'),(1793,'Adler stehend von vorn, Kopf nach rechts, mit leicht geöffneten Flügeln.','Eagle standing facing, head right, wings half-spread.','from CN'),(1795,'Geschlossenes Stadttor, flankiert von zwei Helmtürmen; darüber sechsbögige Galerie.','Closed city gate, flanked by two round towers with conical roof; above, gallery of six arches.','from CN'),(1796,'Schiff mit geblähtem Segel nach rechts auf dem Wasser.','Galley, under full sail, sailing right, in waters.','from CN'),(1797,'Demeter mit Schleier, Ährenkranz und im langen Gewand, nach links auf Korb sitzend, in der gesenkten Rechten drei Ähren mit Mohn, die links an der Fackel.','Veiled Demeter seated left on basket, wearing stephane and long garment, holding three ears of corn and poppy in lowered right hand and long torch in left.','from CN'),(1798,'Brustbild des Maximinus Thrax mit Lorbeerkranz nach rechts.','Laureate bust of Maximinus Thrax, right.','from CN'),(1799,'Demeter mit Schleier im langen Gewand, nach links thronend, in der gesenkten Rechten drei Ähren mit Mohn, den linken Arm auf lange Fackel gestützt. Perlkreis.','Veiled Demeter enthroned left, wearing long garment, holding three ears of corn and poppy in lowered right hand, left resting on long torch. Border of dots.','from CN'),(1800,'Apollon nach rechts sitzend; Lyra spielend.','Apollo seated right, playing lyre.','from CN'),(1801,'Nackter Dionysos stehend von vorn, Kopf nach links, mit der Rechten den Kantharos ausgießend, die Linke auf den mit Bandschleife geschmückten Thyrsos gestützt; links vor ihm, der Panther nach links sitzend, Kopf nach rechts, mit erhobener Vordertatze.','Nude Dionysus standing facing, head left, holding cantharus in right hand over a panther seated left, head right, with raised forepaw, pelleted and filleted thyrsus in left arm.','from CN'),(1802,'Delphin nach rechts, einen Dreizack im Maul haltend; zwischen zwei Thunfischen, oberer nach links, unterer nach rechts.','Dolphin swimming right, holding trident; between two tunnies, upper to left, lower to right.','from CN'),(1803,'Nackter Herakles nach rechts schreitend, den von rechts anspringenden Löwen würgend; unten links Bogen und Köcher.','Nude Heracles advancing right, strangeling lion; on the left side, bow and arrows.','from CN'),(1804,'Nackter Herakles nach rechts schreitend, den von rechts anspringenden Löwen würgend.','Nude Heracles advancing right, strangling lion.','from CN'),(1805,'Nackter Herakles nach links strebend, den von links anspringenden Löwen würgend.','Nude Heracles advancing left, strangling lion.','from CN'),(1806,'Kybele mit Schleier nach links thronend, in der vorgestreckten Rechten Patera haltend, den linken Arm auf das Tympanon gestützt.','Veiled Cybele enthroned left, holding patera in outstretched right hand, left arm resting on tympanon.','from CN'),(1807,'Eros auf Delphin nach rechts reitend, Peitsche in erhobener Rechter haltend.','Eros riding right on dolphin, holding wipe in right hand.','from CN'),(1809,'Mondsichel; darüber sieben achtstrahlige Sterne.','Crescent; above, seven stars with eight rays.','from CN'),(1810,'Nackter Apollon (Bonus Eventus) stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera, in der gesenkten Linken einen Zweig nach unten haltend. Im rechten Feld, E.','Nude Apollo standing facing, head left, holding patera in outstretched right hand and laurel-branch in left hand. In right field, E.','from CN'),(1811,'Nackter Apollon stehend von vorn, Kopf nach links, Lorbeerzweig in der gesenkten Rechten haltend, den linken Arm auf hohen Dreifuß gelegt, Schlange windet sich daran empor. Links im Feld, E.','Nude Apollo standing facing, head left, holding laurel-branch in right hand and leaning left on tripod with serpent. In left field, E.','from CN'),(1812,'Nackter Apollon nach rechts stehend, halb von hinten gesehen, Lorbeerzweig in gesenkter Rechter, Linke mit Gewand in die Hüfte gestemmt; im Feld rechts, E.','Nude Apollo standing right, seen from behind, holding laurel-branch in lowered right hand and cloth pressed with the left on the hip; in right field; E.','from CN'),(1813,'Nackter Ares stehend von vorn, Kopf nach links, mit Helm, unidentifizierbarer Gegenstand in der Rechten; in der Linken senkrechte Speer und Schild am linken Arm. Im Feld links, Wertzeichen; E.','Nude Ares standing facing, head left, wearing helmet, holding an unidentified object in right hand; at left arm shield, holding lance with left hand. In left field, mark of value E.','from CN'),(1814,'Athena nach vorn stehend, Kopf mit Helm nach links, Patera in der ausgestreckten Rechten, Speer in der Linken; zu ihren Füßen Schild; vor ihr Olivenbaum, um den sich eine Schlange windet; im linken Feld, Monogramm E.','Athena standing facing, head with helmet to the left, holding patera in outstretched right hand and lance in left hand; at her feet, shield; in front of her, olive tree, entwined by serpent; monogram E in left field.','from CN'),(1815,'Nackter Herakles nach rechts stehend, den rechten Arm auf die Keule stützend, Löwenfell über dem linken Arm, in der Linken einen Bogen haltend. Im Feld links, E.','Nude Heracles standing right, resting right hand on club, lion skin over left arm, holding bow in left arm. In left field, E.','from CN'),(1816,'Artemis im kurzen, wehenden Chiton, mit wehendem Mantel und in Stiefeln, nach rechts schreitend, in der vorgestreckten Linken Bogen, in der Rechten einen Pfeil aus dem Köcher am Rücken ziehend; zu ihren Füßen Hund nach rechts laufend. Bildleiste. Perlkreis.','Artemis advancing right, wearing short fluttering chiton, fluttering cloak and boots, holding bow in left hand and drawing arrow from quiver at shoulder with right hand; at her feet, hound running right. Ground line. Border of dots.','from CN'),(1818,'Brustbild des jugendlichen Gordian III. nach rechts mit Lorbeerkranz, Panzer und Paludamentum.','Laureate bust of youthful Gordian III, right, wearing cuirass and paludamentum.','from CN'),(1819,'Nackter Athlet stehend von vorn, Kopf nach rechts, sich selbst mit der Rechten bekränzend und Palmzweig in der Linken haltend. Perlkreis.','Nude athlete standing facing, head right, crowning himself with right hand, holding palm branch in left arm. Border of dots.','from CN'),(1820,'Eros auf Delphin nach links reitend, in beiden Händen die Zügel. Perlkreis.','Eros riding left on dolphin, holding reins in both hands. Border of dots.','from CN'),(1821,'Nackter, bärtiger Herakles, nach links schreitend, Kopf nach rechts, mit der Rechten einen Pfeil aus dem Köcher ziehend, in der vorgestreckten Linken den Bogen; im Feld rechts oben und unten je ein Stymphalischer Vogel links fliegend; im Feld rechts, ein dritter, rechts fliegend. Bildleiste. Perlkreis.','Nude bearded Heracles advancing left, head right, drawing arrow with right hand from quiver, holding bow in outstretched left hand; in right field, two Stymphalian birds flying left and a third flying right. Ground line. Border of dots.','from CN'),(1822,'Nackter, bärtiger Herakles, nach rechts schreitend, das Löwenfell über der Schulter, in der Rechten die Keule schwingend, den linken Arm erhoben; rechts, Hippolyte mit wehendem Mantel nach rechts auf einem Pferd reitend, Kopf nach links, in der Rechten das Doppelbeil schwingend. Bildleiste. Perlkreis.','Heracles standing right, lion skin over left arm, holding club overhead in raised right hand and left hand outstretched; at right, Hippolyte, seated right, head left, on a horse to right, wearing fluttering cloak, holding double ax in right hand. Ground line. Border of dots.','from CN'),(1823,'Nackter, bärtiger Herakles nach rechts schreitend, Kopf nach links, das Löwenfell über der linken Schulter, in der Linken die Keule schulternd; in der Rechten Kerberos an der Kette hinter sich herführend; links hinter ihm, ein Baum.','Nude bearded Heracles advancing right, head left, lion skin over left shoulder, holding club with left hand over left shoulder, drawing out Cerberus on a leash, behind him, a tree.','from CN'),(1824,'Zeus umgeben vom Zodiacus; in der Mitte Zeus, sitzend von vorn, in der vorgestreckten Rechten Patera haltend, die Linke auf des Zepter gestützt, links zu seinen Füßen Adler nach links, Kopf nach rechts, mit halb geöffneten Flügeln; das Ganze umgeben vom Zodiakos.','Zeus within zodiac; in the middle, Zeus seated facing, holding patera in outstretched right hand, left resting on sceptre; at his feet, eagle to left, head right, with half spread wings; all within a double circle divided into twelve compartments containing the signs of the zodiac.','from CN'),(1825,'Serapis mit Kalathos links stehend, in der erhobenen Rechten Kranz, im linken Arm das Zepter; rechts Homonoia stehend von vorn, Kopf nach links, in der Rechten Kranz über einen bekränzten flammenden Altar und im linken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Serapis standing left, wearing kalathos, holding wreath in raised right hand, left resting on sceptre; to right Homonoia standing facing, head left, holding wreath in right hand over lighted and garlanded altar and cornucopia in left arm. Ground line. Border of dots.','from CN'),(1827,'Athena stehend von vorn, Kopf nach links, im langem Chiton und mit Helm, in der vorgestreckten Rechten Patera, in der Linken Speer und den Schild haltend. Kurze Bildleiste. Perlkreis.','Athena standing facing, head left, wearing long garment and helmet, holding patera in outstretched right hand and spear with shield in left arm. Short ground line. Border of dots.','from CN'),(1828,'Geflügelte Nemesis (Dikaiosyne) stehend von vorn, Kopf nach links, in der gesenkten Rechten Waage und in der gesenkten Linken die Zügel haltend. Bildleiste. Perlkreis.','Winged Nemesis (Aequitas) standing facing, head left, holding scales in right hand and reins in left hand. Ground line. Border of dots.','from CN'),(1829,'Athena stehend von vorn, Kopf nach links, im langem Chiton und mit Helm, in der vorgestreckten Rechten Patera, in der Linken Zepter haltend; vor ihr, Schild.','Athena standing facing, head left, wearing long garment and helmet, holding patera in outstretched right hand, left resting on sceptre; in front of her, shield.','from CN'),(1830,'Athena stehend von vorn, Kopf nach links, im langen Gewand und mit Helm; in der Rechten einen Kranz über einen flammenden Altar, in der Linken Speer haltend. Bildleiste. Perlkreis.','Athena standing facing, head left, wearing helmet and long garment; holding wreath in right hand over lighted altar and spear in left arm. Ground line. Border of dots.','from CN'),(1831,'Homonoia stehend von vorn, Kopf nach links, in der Rechten Kranz über einen flammenden Altar und im linken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Homonoia standing facing, head left, holding wreath in right hand over lighted altar and cornucopia in left arm. Ground line. Border of dots.','from CN'),(1832,'Nackter Herakles stehend von vorn, Kopf nach links, in der Rechten Kantharos, Löwenfell über dem linken Arm und in der Linken Keule haltend.','Nude Heracles standing facing, head left, holding kantharos in right hand and club in left hand, lion skin over left arm.','from CN'),(1833,'Brustbild des Gallienus nach links mit Lorbeerkranz, Panzer und Paludamentum, Speer rechts haltend, am linken Arm den Schild. Perlkreis.','Laureate bust of Gallienus, left, wearing cuirass and paludamentum, holding spear in right hand and shield in left arm. Border of dots.','from CN'),(1834,'Nackter bärtiger Herakles nach links schreitend, in der erhobenen Rechten die Keule, Löwenfell über dem linken Arm; zwei nach links springende Rinder vor sich hertreibend, von denen das hintere zurückblickt. Bildleiste. Perlkreis.','Nude bearded Heracles advancing left, in raised right hand club, lion skin over left arm; floating two left-leaping cattle, the rear looking backwards. Ground line. Border of dots.','from CN'),(1835,'Herakles nach links schreitend, in der erhobenen Linken die Keule schwingend.','Heracles advancing left, brandishing club in raised left hand.','from CN'),(1836,'Nackter, bärtiger Herakles nach rechts stehend, das Löwenfell über der Schulter; in beiden Händen eine Hacke schwingend; vor ihm, ein Haufen Steine; zu seinen Füßen ein Korb. Perlkreis.','Nude, bearded Heracles standing right, wearing lion skin over shoulder, holding an ax in both hands; in front, a pile of stones; at his feet, basket. Border of dots.','from CN'),(1837,'Drei Chariten (oder Nymphen?) stehend von vorn; an den Schultern umschlungen.','The Three Charites (or Nymphs?) standing facing; holding each other\'s shoulder.','from CN'),(1838,'Nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, mit überschlagenem Bein, in der Rechten die auf dem Dreifuß stehende Lyra haltend; um den Dreifuß windet sich eine Schlange; in der Linken den Lorbeerzweig über seinen Kopf haltend. Bildleiste. Perlkreis.','Nude Apollo standing facing, head left, legs crossed, holding in right arm lyre which rests on tripod; tripod entwined by serpent; left arm over his head, holding a laurel-branch. Ground line. Border of dots.','from CN'),(1839,'Demeter mit Ährenkranz und Schleier nach links auf einer nach rechts geöffneten cista mystica sitzend, aus der sich eine Schlange windet; in der vorgestreckten Rechten einen Mohnkopf zwischen zwei Ähren haltend, den linken Arm auf lange Fackel gestützt. Perlkreis.','Veiled Demeter seated left cista mystica with half-open lid, out of which serpent creeps right, wearing corn wreath, holding a poppy between two ears of corn in right hand, left resting on long torch. Border of dots.','from CN'),(1840,'Zwei Preiskronen, in jeder ein Palmzweig. Bildleiste. Perlkreis.','Two prize crowns; each containing a palm branch. Ground line. Border of dots.','from CN'),(1841,'Zwei verzierte Preiskronen, in jeder zwei Palmzweige; dazwischen Schildkröte? Bildleiste. Perlkreis.','Two ornated prize crowns, each containing two palm fonds; between them tortoise? Ground line. Border of dots.','from CN'),(1842,'Schiff mit geblähtem Segel nach links auf dem Wasser; an Bord sieben Ruderern. Perlkreis.','Galley, under full sail, sailing left, in waters, with seven rowers. Border of dots.','from CN'),(1843,'Demeter mit Schleier nach links auf einem Felsen sitzend, in der vorgestreckten Rechten zwei gesenkte Ähren, den linken Arm auf lange Fackel gestützt. Bildleiste. Perlkreis.','Veiled Demeter seated left on rock, holding two ears of corn in outstretched right hand, left resting on long torch. Ground line. Border of dots.','from CN'),(1845,'Demeter und Homonoia, einander die Rechte reichend; Links Demeter mit Ährenkranz und Schleier nach rechts stehend, die Linke auf die lange brennende Fackel gestützt; rechts Homonoia mit Kalathos stehend von vorn, Kopf nach links, im linken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Demeter and Homonoia, clasping right hands; to left, veiled Demeter standing right, wearing corn wreath; to right, Homonoia standing facing, head left, wearing kalathos, holding cornucopia in left arm. Ground line. Border of dots.','from CN'),(1846,'Brustbild des Gordian III. nach rechts mit Lorbeerkranz und Paludamentum.','Laureate bust of Gordian III, right, wearing paludamentum.','from CN'),(1847,'Nackter Athlet stehend von vorn, Kopf nach rechts, sich selbst mit der Rechten bekränzend und Palmzweig in der Linken haltend. Links im Feld, E. Kurze Bildleiste. Perlkreis.','Nude athlete standing facing, head right, crowning himself with right hand, holding palm branch in left arm. In left field, E. Short ground line. Border of dots.','from CN'),(1848,'Protome eines springenden Pferdes nach rechts; oben links, Monogramm.','Forepart of prancing horse, right; to outer left, monogram.','from CN'),(1849,'Links, Statue der Artemis von Ephesos, stehend von vorn, neben ihrem Kopfschmuck links eine Mondsichel, rechts ein achtstrahliger Stern, zu ihren Füßen ein Hirsch, nach rechts stehend, und rechts ein zweiter nach links stehend; rechts, Homonoia stehend von vorn, Kopf nach links in der vorgestreckten Rechten Patera über einen flammenden Altar ausgießend, im linken Arm das Füllhorn. Bildleiste. Perlkreis.','At left, statue of Artemis of Ephesos standing facing, next to her headdress at left a crescent, at right a star with eight rays, at her feet to left a deer standing right and at right a second deer standing left; at right, Homonoia standing facing, head left, holding patera in her right hand over a lighted altar and a cornucopia in left arm. Gorund line. Border of dots.','from CN'),(1850,'Links, Amazone von Smyrna mit Mauerkrone in kurzem Chiton und in Stiefeln nach rechts schreitend, in der Linken das Doppelbeil schulternd; rechts, Stadtgöttin von Perinth mit Mauerkrone stehend von vorn, Kopf nach links, im linken Arm ein Steuerruder, beide sich die Rechte reichend; zwischen beiden am Boden zwei Prorae sich gegenüberstehend. Bildleiste. Perlkreis.','A left, turreted Amazon of Smyrna advancing right, wearing short chiton and boots, holding a double axe over left shoulder, clasping right hands with turreted city goddess of Perinthus, standing facing, head left, holding a rudder in left arm; between two prows facing each other. Ground line. Border of dots.','from CN'),(1851,'Preistisch nach links mit zwei Preiskronen; darunter Amphora. Perlkreis.','Agonistic table, left, surmounted by two prize crowns; below, amphora. Border of dots.','from CN'),(1852,'Athena stehend von vorn, Kopf nach rechts, im langen Gewand und mit Helm; in der erhobenen Linken unbestimmten Gegenstand, in der Rechten nach unten gerichteten Speer haltend; vor ihr, Schild.','Athena standing facing, head right, wearing long garment and helmet; holding unidentified object in left raised hand and inverted spear in right arm; at her feet, shield placed on ground.','from CN'),(1853,'Herakles stehend von vorn, Kopf nach rechts, den rechten Arm auf die Keule gestützt; rechts davon Löwenfell über einem unbestimmten Gegenstand.','Heracles standing facing, head right, resting right hand on club; to right, lion skin hanging over uncertain object.','from CN'),(1854,'Kopf des Serapis mit Lorbeerkranz und Lotosblüte und der Isis mit ihrem Kopfschmuck und Ährenkranz, hintereinander gestaffelt nach rechts.','Jugate heads of Serapis, wearing laurel wreath and lotus, and of Isis, wearing her headdress and wreath of ears, right.','from CN'),(1855,'Kopf des Serapis mit Lorbeerkranz und Lotosblüte und der Isis mit ihrem Kopfschmuck und Ährenkranz, hintereinander gestaffelt nach rechts. Barbarisiert.','Jugate heads of Serapis, wearing laurel wreath and lotus, and of Isis, wearing her headdress and wreath of ears, right. Barbarized.','from CN'),(1856,'Anubis nach rechts schreitend in der Rechten Palmzweig schulternd; im Feld links Monogramm; rechts zwei miteinander verbundene Pferdeprotomen. Kurze Bildleiste.','Anubis advancing right, holding palm branch with right hand over shoulder; in field to left monogram; to right emblem of two conjoined foreparts of prancing horses to right and left. Short ground line.','from CN'),(1857,'Apis nach links stehend, zwischen seinen Beinen zwei miteinander verbundene Pferdeprotomen, die rechte geflügelt; im Feld links Monogramm. Bildleiste.','Apis standing left, between his legs emblem of two conjoined foreparts of prancing horses; the right horse winged; in left field monogram. Ground line.','from CN'),(1858,'Apis nach links stehend, zwischen seinen Beinen zwei miteinander verbundene Pferdeprotomen, die rechts geflügelt. Bildleiste.','Apis standing left, between his legs emblem of two conjoined foreparts of prancing horses; the right horse winged.','from CN'),(1859,'Apis nach links stehend, zwischen seinen Beinen zwei miteinander verbundene Pferdeprotomen; im Feld links Monogramm. Bildleiste.','Apis standing left, between his legs emblem of two conjoined foreparts of prancing horses; in left field monogram. Ground line.','from CN'),(1860,'Apis nach links stehend, Kopf gesenktem, zwischen seinen Beinen zwei miteinander verbundene Pferdeprotome. Bildleiste.','Apis standing left, head lowered, between his legs emblem of two conjoined foreparts of prancing horses. Ground line.','from CN'),(1862,'Brustbild des Serapis mit Taenia, einem breiten, mit Lorbeerblättern verzierten Kalathos und Gewand. Perlkreis.','Draped bust of Serapis, right, wearing taenia and laureate kalathos. Border of dots.','from CN'),(1863,'Isis stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Sistrum über einen flammenden und bekränzten Altar haltend, die Linke aus das Zepter gestützt. Perlkreis.','Isis standing facing, head left, holding sistrum in outstretched right hand over lighted and garlanded altar and sceptre in left hand. Border of dots.','from CN'),(1864,'Brustbild der jugendlichen Poppaea nach rechts mit Diadem, Melonenfrisur mit Zopf und Gewand. Perlkreis.','Diademed and draped bust of youthful Poppaea, right, with \"melon coiffure\" with braid. Border of dots.','from CN'),(1865,'Brustbild der Poppaea nach rechts mit Diadem, Melonenfrisur mit Zopf und Gewand. Perlkreis.','Diademed and draped bust of Poppea, right, with \\\"melon coiffure\\\", a tail and a long curl falling. Border of dots.','from CN'),(1866,'Brustbild der Poppaea nach rechts mit niedrigem Diadem, Melonenfrisur mit Zopf, einer langen herabhängenden Locke und Gewand. Perlkreis.','Draped bust of Poppaea, right, wearing low diadem and with \"melon coiffure\" with braid and and a long curl falling. Border of dots.','from CN'),(1867,'Brustbild der Poppaea nach rechts mit hohem Diadem, Melonenfrisur mit Zopf und Gewand. Perlkreis.','Draped bust of Poppaea, right, wearing high diadem and with \"melon coiffure\" with braid. Border of dots.','from CN'),(1868,'Nackter Athlet stehend von vorn, Kopf nach links, Kranz in vorgestreckter Rechten haltend, Palmzweig im linken Arm. Im Feld links Wertzeichen; E.','Nude athlete standing facing, head left, holding crest in outstretched right and palm leaf in left. In left field, mark of value; E.','from CN'),(1869,'Brustbild des Gordian III. nach rechts mit Strahlenkrone und Paludamentum.','Radiated bust of Gordian III, right, wearing paludamentum.','from CN'),(1871,'Serapis mit Kalathos stehend von vorn, Kopf nach links, in der Linken das Zepter, die Rechte über flammendem Altar erhoben.','Serapis standing facing, head left, wearing kalathos, holding long sceptre in his left hand, his raising right arm over lighted altar.','from CN'),(1873,'Kaiser (Antoninus Pius) in Toga nach rechts auf einem Pferd reitend. Bildleiste. Perlkreis.','Togate emperor (Antoninus Pius) in military attire riding right on horseback. Ground line. Border of dots.','from CN'),(1874,'Protome eines springenden Pferdes nach links. Linienkreis.','Forepart of prancing horse, left. Linear border.','from CN'),(1875,'Kopf der Gorgo.','Head of Gorgo.','from CN'),(1876,'Weintraube mit Blättern und Ranken im quadratum incusum.','Bunch of grapes on vine branch within incuse square.','from CN'),(1877,'Weintraube mit Blättern und Ranken im quergestellten quadratum incusum.','Bunch of grapes on vine branch diagonally positioned within incuse square.','from CN'),(1878,'Geflügelte Nike auf einer nach rechts galoppierenden Biga; in der Rechten die Zügel, in der Linken den Palmzweig. Bildleiste. Perlkreis.','Nike standing in galloping biga, right; holding palm branch in left hand and reigns with right. Ground line. Border of dots.','from CN'),(1879,'Geflügelte Nemesis auf einer nach rechts galoppierenden Biga, in der Rechten die Zügel, in der Linken die Peitsche. Bildleiste. Perlkreis.','Winged Nemesis standing in galloping biga right, holding reins with right and whip in left hand. Ground line. Border of dots.','from CN'),(1880,'Brustbild des jugendlichen Caracalla nach rechts mit Lorbeerkranz und Paludamentum.','Laureate bust of youthful Caracalla, right, wearing paludamentum.','from CN'),(1881,'Fassade eines tetrastylen Tempels, mit Akrotere und Antefixe am Dach, im Giebel Schlange geringelt; darin Asklepios nach vorn stehend, in der Rechten Schlangenstab, die Linke vor der Brust. Perlkreis.','Façade of a tetrastyle temple, acroteria and antefixa along roof, with a curled serpent on the pediment; within Asclepius standing facing, holding serpent-staff in right hand, the left in front of the chest. Border of dots.','from CN'),(1882,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer und wehendem Paludamentum nach rechts auf einem Pferd reitend, in der Rechten den umgedrehten und schräg nach links gerichteten Speer haltend.','Emperor (Caracalla) in military attire riding right on horseback, wearing cuirass and fluttering paludamentum, holding a reversed and inverted spear in right hand.','from CN'),(1883,'Brustbild des bärtigen Geta nach rechts mit Lorbeerkranz und Schuppenpanzer. Perlkreis.','Laureate bust of bearded Geta, right, wearing scale cuirass. Border of dots.','from CN'),(1884,'Brustbild des Elagabal nach rechts, von vorn gesehen, mit Lorbeerkranz, Panzer und Paludamentum, über der Iinken Schulter die Ägis.','Laureate bust of Elagabalus, right, seen from front, wearing cuirass and paludamentum; with aegis on left shoulder.','from CN'),(1885,'Kopf des (jugendlichen) Dionysos nach rechts, mit Efeukranz von fünf Blättern und einer Frucht, Haarband, seitlich eingerollter Frisur, die einen Knoten am Nacken bildet, mit drei langen Locken auf der rechten und einer Locke auf der linken Schulter.','Head of (youthful) Dionysus, right, wearing taenia and ivy wreath with five leaves and a fruit. Hair dress rolled in the back and with three curls falling on right and one on left shoulder.','from CN'),(1886,'Kopf des (jugendlichen) Dionysos nach rechts, mit Efeukranz von fünf Blättern, einer Frucht und Rosette, Haarband, seitlich um einen Punkt eingerollter Frisur, die einen Knoten am Nacken bildet, mit zwei langen Locken auf der rechten Schulter.','Head of (youthful) Dionysus, right, wearing taenia and ivy wreath with five leaves, a fruit and rosette. Hair dress rolled in the back around a dot and with two curls falling on right shoulder.','from CN'),(1887,'Kopf der Persephone nach rechts.','Head of Persephone, right.','from CN'),(1888,'Kopf der Demeter nach rechts mit Ohrring, Halskette und eingerollten Haaren. Im Linienquadrat.','Head of Demeter, right, wearing earring, neacklace and a rolled hair-dress. All in linear square.','from CN'),(1890,'Löwe nach links springend.','Lion leaping left.','from CN'),(1891,'Löwenprotome nach links, einen Speer mit dem Kiefer brechend; im Linearquadrat.','Forepart of a lion, left, breaking spear in jaws; all within linear square.','from CN'),(1892,'Löwe nach links hockend, einen Speer mit dem Kiefer brechend; unter seinem Bauch, Stern; im Abschnitt, Getreidekorn. Bildleiste.','Lion crouching left, breaking spear in jaws; under the lion, star; in exergue, grain corn. Ground line.','from CN'),(1893,'Löwe nach links hockend, einen Speer mit dem Kiefer brechend; im Abschnitt, Getreidekorn und Delphin. Bildleiste.','Lion crouching left, breaking spear in jaws; in exergue, grain corn and dolphin. Ground line.','from CN'),(1894,'Löwe nach links hockend, einen Speer mit dem Kiefer brechend; im Abschnitt, Getreidekorn und Monogramm. Bildleiste.','Lion crouching left, breaking spear in jaws; in exergue, grain corn and monogram. Ground line','from CN'),(1895,'Löwenprotome nach links, einen Speer mit dem Kiefer brechend; darunter Getreidekorn.','Forepart of a lion, left, breaking spear in jaws; under the lion, grain.','from CN'),(1896,'Getreidekorn.','Grain.','from CN'),(1897,'Kopf eines jungen Mannes mit langem Haar (Saratokos?) nach rechts.','Head of a young man (Saratokos?), right, with long hair.','from CN'),(1898,'Zur Hälfte geöffnetes Stadttor mit gewölbtem Türsturz, von zwei Türmen flankiert; links Relief der drei Chariten (oder Nymphen?), rechts Relief des thrakischen Reiters; darüber siebenbögige Galerie mit Statuen darin; darauf Quadriga; davor Nike (oder Artemis?) nach rechts schreitend; dahinter eine weitere Statue.','City gate with arched half-open door, flanked by two towers; to left, relief of the three Charites (or Nymphs?), to right, relief of Thracian rider; above, gallery of seven arches with statues inside; surmounted by figure standing right in quadriga; in front of which Nike(or Artemis?) advancing right; behind, a second statue.','from CN'),(1899,'Stadtring von Bizye mit zehn Türmen und Stadttor, halbgeöffnet, von zwei Türmen flankiert; darüber Galerie mit sieben Bögen und jeweils einer Figur darin; darauf Quadriga nach rechts, von zwei Figuren flankiert; links neben dem Tor Relief vom thrakischen Reiter, rechts neben dem Tor Relief von den drei Chariten (oder Nymphen?); im Inneren der Stadt zwei Basilicae, drei Siegessäulen mit Statuen und drei weitere Gebäuden.','City view of Bizye walls with ten towers and half-opened city gate, flanked by two towers; above, gallery of seven arches with statues inside; surmounted by quadriga to right flanked by two figures; to left of the gate, relief of Thracian rider, to right, relief of the three Charites (or Nymphs?); inside the wall, two basilicae, three victory columns with statues and three other buildings.','from CN'),(1900,'Brustbild des Philippus Arabs nach links, von vorn gesehen, mit Lorbeerkranz, Panzer und Paludamentum. Perlkreis.','Laureate bust of Philip the Arab, left, seen from front, wearing cuirass and paludamentum. Border of dots.','from CN'),(1901,'Ares stehend von vorn, Kopf nach links, mit Panzer, Helm mit Helmbusch und in Stiefeln, Speer in der Rechten, runden Schild in der Linken haltend. Perlkreis.','Ares standing facing, head left, wearing cuirass, helmet and boots, holding spear in right hand and round shield in left arm. Border of dots.','from CN'),(1902,'Isis stehend von vorn, Kopf nach rechts, in der gesenkten Rechten Situla und in der erhobenen Linken  Sistrum haltend. Perlkreis.','Isis standing facing, head right, holding situla in lowered left hand and sistrum in raised right hand. Border of dots.','from CN'),(1903,'Tyche mit Kalathos nach rechts thronend, in der Rechten Steuerruder und im linken Arm das Füllhorn haltend. Perlkreis.','Tyche enthroned right, wearing calathus, holding rudder in right hand and cornucopia in left arm. Border of dots.','from CN'),(1905,'Brustbild des Philippus Arabs nach rechts, von vorn gesehen, mit Lorbeerkranz, Panzer und Paludamentum; über der linken Schulter die Ägis, auf der Brustplatte Adler mit geöffneten Flügeln. Perlkreis.','Laureate bust of Philip the Arab, right, seen from front, wearing cuirass and paludamentum; with aegis on left shoulder and eagle, wings spread, on breastplate. Border of dots.','from CN'),(1906,'Hades-Serapis, Isis, Harpokrates und Demeter; Hades-Serapis thronend von vorn; die Rechte über Kerberos vor ihm vorgestreckt und im linken Arm das Zepter haltend; rechts, Harpokrates stehend von vorn, Kopf nach rechts, mit Füllhorn in der Linken; Isis stehend von vorn, Kopf nach links, mit Sistrum in der Rechten und Füllhorn in der Linken; links, Demeter nach rechts stehend mit langer Fackel in der Rechten und Figur des Kynokephalos zu Füßen.','Hades-Serapis, Isis, Harpokrates and Demeter; in the centre, Hades-Serapis enthroned facing, extending right hand over Cerberus, holding sceptre in left hand; at right, Isis standing facing, head left, holding sistrum in right hand and cornucopia in left arm, at her right, small figure Harpokrates standing facing, head left, holding cornucopia in left arm; at left, Demeter standing facing, head right, holding long torch in left arm and to her left small figure of Kynokephalos.','from CN'),(1907,'Zeus (Aëtophoros) im langen Gewand nach links thronend, in der vorgestreckten Rechten einen Adler nach rechts und in der Linken Zepter haltend.','Zeus (Aëtophoros) enthroned left, wearing long garment, holding eagle, right, in outstretched right hand and sceptre in left hand.','from CN'),(1908,'Hera im langen Gewand nach links thronend, mit dem rechten Arm einen Pfau auf ihrem linken Oberschenkel umfassend, die Linke auf das Zepter gestützt.','Hera enthroned left, wearing long garment, comprising peacock seated on her left hip with right arm, left resting on long sceptre.','from CN'),(1909,'Jüngling in kurzer Kleidung nach rechts auf Felsen sitzend, den linken Fuß auf den Fels aufgestellt, den Oberkörper vorgebeugt.','Youth seated right on rock, wearing short garment, with his left foot on the rock, leaning forward.','from CN'),(1910,'Tyche Poleos nach rechts thronend, mit ihrem rechten Arm sich auf ein Steuerruder stützend; im linken Arm das Füllhorn haltend; rechts, nackter Heros stehend von vorn, Kopf nach links, in der Linken Speer und Gewand, mit der Rechten Tyche bekränzend. Perlkreis.','Tyche Poleos enthroned right, leaning on rudder with right arm and holding cornucopia in left arm; at right, nude Heros standing facing, head left, holding spear and garment in left arm and crowning Tyche with right hand. Border of dots.','from CN'),(1911,'Kaiser (Philippus Arabs) in Kriegsbekleidung mit Panzer und Paludamentum nach rechts stehend, in der Rechten Speer und im linken Arm Parazonium haltend; linker Fuß auf Prora nach rechts gestellt.','Emperor (Philip the Arab) in military attire standing right, wearing cuirass and paludamentum, holding spear in right hand and parazonium in left arm; his left foot on prora, right.','from CN'),(1912,'Demeter stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera haltend, den linken Arm auf lange Fackel gestützt.','Demeter standing facing, head left, holding patera in outstretched right hand, left resting on long torch.','from CN'),(1914,'Nackter Zeus (Epikarpios) stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera und im linken Arm Ähren haltend.','Nude Zeus (Epikarpios) standing facing, head left, holding patera in outstretched right hand and ears of corn in left hand.','from CN'),(1915,'Tyche mit Mauerkrone stehend von vorn, Kopf nach links, das Steuerruder in der Rechten und das Füllhorn im linken Arm haltend. Perlkreis.','Turreted Tyche standing facing, head left, holding rudder in right hand and cornucopia in left arm. Border of dots.','from CN'),(1916,'Demeter stehend von vorn, Kopf nach rechts, die Rechte auf lange Fackel gestützt, in der Linken zwei Ähren und Mohnkopf haltend. Perlkreis.','Demeter standing facing, head right, right resting on long torch, holding two ears of corn and poppy in left hand. Border of dots.','from CN'),(1917,'Brustbild der Faustina II. nach rechts mit Diadem und Gewand, das Haar hinten zum Knoten hochgesteckt. Perlkreis.','Diademed and draped bust of Faustina II, right, wearing hair knot. Border of dots.','from CN'),(1918,'Brustbild des bärtigen Caracalla mit Lorbeerkranz nach rechts. Perlkreis.','Laureate bust of bearded Caracalla, right. Border of dots.','from CN'),(1919,'Nymphe der Strymon-Gegend, nach links gelagert, mit Lorbeerkranz und nacktem Oberkörper; die vorgestreckte Rechte auf einem Bergrücken mit Höhleneingang, die Linke auf eine umgekippte Urne gestützt, aus der Wasser rinnt, umfasst sie einen ihren Kopf überragenden Weinstock mit Reben und Blättern. Auf dem Bergrücken rechts aufsteigend ein kleiner nackter Genius, vom Weinstock Reben pflückend, daneben ΒΟΤΡV; vor dem Höhleneingang ein zweiter nackter Genius nach links mit einem Sack mit Erzen auf dem Rücken, über ihm ΑΡΓΥΡΟϹ; unter dem Quellgefäß hockt links ein dritter nackter Genius und schöpft mit den Händen aus dem Wasser Gold; darüber ΧΡΥϹΟϹ. Im Abschnitt, in einem Getreidefeld ein vierter nackter Genius, links schreitend und Ähren lesend, daneben ϹΤΡΑΧΥ. Bildleiste. Perlkreis.','Laureate nymph of the Strymon region reclining left, stripped to the waist, the outstretched right on a mountain ridge with a cave entrance, resting left arm on upturned water-urn, from which flows water, embracing vine with grapes and leafs leaning over her head. On the mountain small naked genius climbing up right picking grapes from the vine, next to him, ΒΟΤΡV; in front of the cave entrance a second naked genius to left with bag full of ore on the back, above him, ΑΡΓΥΡΟϹ; under the water spring leaning to left third naked Genius scooping with hands gold from the water, above ΧΡΥϹΟϹ. In exergue, in a cornfield forth naked genius advancing and collecting corn ears, next to him ϹΤΡΑΧΥ. Ground line. Border of dots.','from CN'),(1920,'Hera mit Kalathos und im langen Gewand stehend von vorn, Kopf nach links, in der gesenkten Rechten unbestimmten Gegenstand haltend, die Linke auf das lange Zepter gestützt. Kurze Bildleiste. Perlkreis.','Hera standing facing, head left, wearing kalathos and long garment, holding uncertain object in lowered right hand, left resting on long sceptre. Short gorund line. Border of dots.','from CN'),(1921,'Nackter Zeus stehend von vorn, Kopf nach links, im linken Arm Blitzbündel, den rechten Arm erhoben. Perlkreis.','Nude Zeus standing facing, head left, holding thunderbolt in left arm and outstretching right arm. Border of dots.','from CN'),(1922,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln, stehend von vorn, Kopf nach rechts, in der Rechten nach unten gerichteten Speer und im linken Arm Parazonium haltend; er setzt den linken Fuß auf den Rücken eines vor ihm nach rechts knienden Gefangenen, Kopf nach links, mit phrygischer Mütze und hinter dem Rücken gefesselten Händen. Bildleiste. Perlkreis.','Emperor (Caracalla) in military attire standing facing, head right, wearing cuirass, fluttering paludamentum and boots, holding transverse spear in right hand and parazonium in left hand, setting his left foot on the back of a captive kneeling right, head left, with Phrygian cap and bound arms behind back. Ground line. Border of dots.','from CN'),(1923,'Nemesis (Dikaiosyne) mit Kalathos stehend von vorn, Kopf nach links, in der Rechten Waage, im linken Arm das Füllhorn haltend; zu ihren Füßen Rad.','Nemesis (Aequitas) standing facing, head left, wearing kalathos, holding scales in right hand, cornucopia in left arm; at her feet, wheel.','from CN'),(1924,'Athena stehend von vorn, Kopf nach links, im langem Chiton und mit Helm, in der Rechten sich auf einem am Boden abgestellten Schild stützend, in der Linken den nach unten gerichteten Speer haltend. Perlkreis.','Athena standing facing, head left, wearing helmet and long garment, holding inverted spear in left hand and resting right hand on shield. Border of dots.','from CN'),(1925,'Hera mit Stephane und langem Gewand stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über flammenden Altar haltend, die Linke auf das lange Zepter gestützt. Bildleiste. Perlkreis.','Hera standing facing, head left, wearing stephane and long garment, holding patera in outstretched right hand over lighted altar, left resting on long sceptre. Ground line. Border of dots.','from CN'),(1926,'Asklepiosstab von einer Schlange umringelt, Kopf nach rechts. Kurze Bildleiste. Perlkreis.','Asclepios-staff entwined by serpent, head right. Short ground line.','from CN'),(1927,'Brustbild der Crispina nach rechts mit Gewand und Melonenfrisur, das Haar hinten zum Knoten hochgesteckt. Perlkreis.','Draped bust of Crispina, right, with \"melon coiffure\" and a high knot. Border of dots.','from CN'),(1929,'Kopf des Hadrian nach rechts. Perlkreis.','Head of Hadrian, right. Border of dots.','from CN'),(1930,'Eberkopf nach links. Perlkreis.','Boar\'s head, left. Border of dots.','from CN'),(1931,'Nackter Apollon stehend von vorn, Kopf nach links, Lorbeerzweig in der Rechten haltend, den linken Arm auf hohen Dreifuß gelegt.','Nude Apollo standing facing, head left, holding laurel-branch in right hand and leaning left on tripod.','from CN'),(1932,'Nackter Jüngling (Dioskur) stehend von vorn, Kopf nach rechts, in der Rechten Speer, in der Linken Zügel haltend; hinter ihm, Pferd nach rechts stehend, der rechte Huf erhoben.','Nude youth (Dioscur) standing facing, head right, holding a spear in right hand and reigns in left hand; behind him, a horse standing right, right hoof raised.','from CN'),(1933,'Nackter Apollon nach rechts schreitend, in der vorgestreckten Linken Bogen, mit der Rechten Pfeil aus dem Köcher am Rücken ziehend.','Nude Apollo advancing right, holding bow in left hand, drawing arrow with right hand from quiver at shoulder.','from CN'),(1934,'Dionysos stehend von vorn im kurzem Chiton und in Stiefeln, Kopf nach links, in der Rechten den Kantharos ausgießend, die Linke auf den Thyrsos gestützt.','Dionysus standing facing, head left, wearing short chiton and boots, holding kantharos in right hand and thyrsus in left arm.','from CN'),(1935,'Kopf des Antoninus Pius nach links.','Bare head of Antoninus Pius, left.','from CN'),(1936,'Hygieia mit überkreuzten Beinen nach rechts stehend, die Schlange im rechten Arm aus einer Patera auf einer Säule vor ihr fütternd.','Hygieia standing right, legs crossed, feeding serpent held in right arm from patera set on column in front of her.','from CN'),(1937,'Kopf des bärtigen Herakles nach links, mit Löwenfell um den Hals und Keule über der rechten Schulter.','Head of bearded Heracles, left, wearing lion skin around neck, holding club over right shoulder.','from CN'),(1938,'Geflügelte Nemesis (Nike) stehend von vorn, Kopf nach links, die Rechte vor der Brust, im linken Arm den Palmzweig; zu Füßen links Greif nach links stehend, Kopf nach oben. Perlkreis.','Winged Nemesis (Nike) standing facing, head left, right hand in front of her chest; holding palm branch in left arm; at her feet, griffin standing left, head upwards. Border of dots.','from CN'),(1939,'Ares stehend von vorn, Kopf nach links, mit Helm mit Helmbusch und in Stiefeln, Speer in der Rechten, Parazonium in der Linken haltend; zu seinen Füßen rechts Schild. Perlkreis.','Ares standing facing, head left, wearing crested helmet and boots, holding spear in right hand and parazonium in left arm; at his feet, right, shield. Border of dots.','from CN'),(1940,'Kaiser (Geta) nach rechts auf einem Pferd reitend, in der Rechten das Zepter schräg haltend.','Emperor (Geta) in military attire riding right on horseback, holding transverse sceptre in right hand.','from CN'),(1941,'Kaiser (Antoninus Pius) nach rechts auf einem Pferd reitend, in der Rechten Speer schräg haltend.','Emperor (Antoninus Pius) in military attire riding right on horseback, holding transverse spear in right hand.','from CN'),(1942,'Kaiser (Commodus) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln nach rechts auf einem Pferd reitend, in der Rechten Speer schräg haltend. Perlkreis.','Emperor (Commodus) in military attire riding right on horseback, wearing cuirass, fluttering paludamentum and boots, holding transverse spear in right hand; left horse hoof raised. Border of dots.','from CN'),(1943,'Kentaur nach links galoppierend und in beiden Händen ein Gefäß auf der linken Schulter stützend; auf seinem Rücken Pan mit Ziegenbeinen nach links sitzend und den Aulos spielend.','Centaur galopping right, supporting a vessel on his left shoulder; on his back Pan with goat legs seated left, playing his aulos.','from CN'),(1944,'Kopf des Commodus mit Strahlenkrone nach rechts.','Radiate head of Commodus, right.','from CN'),(1945,'Silen stehend von vorn, Kopf nach links in der Linken das Dinysoskind auf seiner linken Schulter stützend; zu seinen Füßen links, kleines Silenenkind.','Silenus standing facing, head left, supporting infant Dionysos with left hand on his left shoulder; at his feet, left, infant Silenus.','from CN'),(1947,'Artemis im kurzen Chiton und in Stiefeln nach rechts schreitend, Kopf nach links, in der vorgestreckten Linken Bogen, in der Rechten Pfeil aus dem Köcher am Rücken ziehend; rechts vor ihr Hund nach rechts laufend. Bildleiste. Perlkreis.','Artemis advancing right, head left, wearing short chiton and boots, holding bow in left hand, drawing arrow with right hand from quiver at shoulder; to right hound running right. Ground line. Border of dots.','from CN'),(1948,'Kaiser (Septimius Severus) in Kriegsbekleidung