ch links, im langem Chiton und mit Helm, in der vorgestreckten Rechten Patera, in der Linken Speer haltend; zu ihren Füßen Schild. Perlkreis.','Athena standing facing, head left, wearing long garment and helmet, holding patera in outstretched right hand and spear in left arm; at her feet, shield placed on ground. Border of dots.','from CN'),(1953,'Kaiser (Septimius Severus) in Kriegsbekleidung mit Panzer und wehendem Paludamentum nach rechts auf einem Pferd reitend, im rechten Arm den schräg nach unten gerichteten Speer haltend. Kurze Bildleiste. Perlkreis.','Emperor (Septimius Severus) in military attire riding right on horseback, wearing cuirass and fluttering paludamentum, holding transverse spear in right hand. Short ground line. Border of dots.','from CN'),(1954,'Fassade eines tetrastylen Tempels auf Krepis mit korinthischen Säulen, Schild im Giebel und Akroteren am Dach; darin Tyche stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera und im linken Arm das Füllhorn haltend.','Façade of a tetrastyle temple on crepidoma with four Corinthian columns, shield on pediment and acroteria on roof; within Tyche standing facing, head left, holding patera in outstretched right hand and cornucopia in left arm.','from CN'),(1955,'Artemis im kurzen, wehenden Chiton, mit wehendem Mantel und in Stiefeln, nach rechts schreitend, in der vorgestreckten Linken Bogen, in der Rechten einen Pfeil aus dem Köcher am Rücken ziehend.','Artemis advancing right, wearing short fluttering chiton, fluttering cloak and boots, holding bow in left hand and drawing arrow from quiver at shoulder with right hand.','from CN'),(1956,'Halbnackte Aphrodite stehend von vorn, Kopf nach rechts, in der Rechten einen Apfel, in der Linken den fallenden Chiton haltend; neben ihr zwei Eroten (?).','Half-nude Aphrodite standing facing, head right, holding apple in right hand, holding falling chiton with left hand; next to her, two Erotes (?).','from CN'),(1957,'Artemis stehend von vorn, Kopf 