nd.','from CN'),(2045,'Athena (Nikephoros) nach links thronend, in der vorgestreckten Rechten Nike haltend; linker Arm hinten am Schild mit Löwenkopf; im Hintergrund diagonal, Speer; im inneren Feld, links, Löwenprotome nach links.','Athena (Nikephoros) enthroned left, holding Nike in outstretched right hand; left arm resting on shield with lion\'s head behind; in background, transverse spear; in inner left field, lion forepart, left.','from CN'),(2047,'Nike nach links stehend, in der vorgestreckten Rechten Kranz und im linken Arm Stylis haltend; unter dem rechten Flügel, Bukephalion; im linken äußeren Feld, Löwenprotome nach links über Kreis mit Monogramm.','Nike standing left, holding wreath in extended right hand and stylis in left arm; below right wing, bukephalion; in outer left field, forepartof a lion, left, above monogram in a circle.','from CN'),(2048,'Weinrebe mit vier Trauben, zwei auf jeder Seite, im Linienquadrat; im Feld unten, Kantharos; im quadratum incusum.','Vine with four bunches of grapes within linear square; in field below, cantharus; all within incuse square.','from CN'),(2049,'Kopf eines Mannes nach rechts mit attischem Helm mit Helmbusch und Wangenschutz.','Male head, right, wearing a crested attic helmet with cheek guard.','from CN'),(2050,'Rüstung von vorn.','Armour seen from front.','from CN'),(2051,'Köcher mit Bogen und Pfeilen.','Quiver with a bow and arrows.','from CN'),(2052,'Weinrebe mit vier Trauben, zwei auf jeder Seite, im Linienquadrat; im äußeren Feld links, Rosette; im quadratum incusum.','Vine with four bunches of grapes within linear square; in left field, one rosette; all within incuse square.','from CN'),(2053,'Pferd nach links schreitend; darüber Monogramm.','Horse advancing left; above, monogram.','from CN'),(2054,'Adler mit geschlossenen Flügeln nach links auf einem Blitzbündel stehend; im Feld rechts Monogramm.','Eagle standing left on thunderbolt, wings closed, in field right monogram.','from CN'),(2055,'Weinrebe mit v