','from CN'),(2079,'Weinrebe mit vier Trauben, zwei auf beiden Seiten, im Linienquadrat; im Feld links, Fliege; im quadratum incusum.','Vine with four bunches of grapes, two on each side, within linear square; in upper left field, a fly; all within incuse square.','from CN'),(2081,'Nackter Poseidon nach rechts stehend, das linke Bein auf einen Felsen setzend, die Rechte auf den Dreizack gestützt und in der auf das linke Knie gestützten Linken unbestimmten Gegenstand haltend. Bildleiste.','Nude Poseidon standing right, left foot on rock, holding tripod in right arm and unidentified object in left hand, leaned on his left knee. Ground line.','from CN'),(2082,'Nackter, bärtiger Herakles stehend von vorn, Kopf nach rechts, Löwenfell über dem linken Arm, den rechten Arm auf die gesenkte Keule gestützt, in der Linken die Äpfel der Hesperiden; rechts neben ihm, der Baum der Hesperiden, um den sich die Schlange (Ladon) windet, Kopf nach Iinks, rechts hinter dem Baum, eine Hesperide im langen Gewand, nach rechts schreitend, Kopf nach links. Perlkreis.','Nude bearded Heracles standing facing, head right, holding club in right hand, lion skin over left arm and apples of the Hesperides in left hand; at right, serpent (Ladon) coiling around tree, at right, Hesperide advancing right, head left. Border of dots.','from CN'),(2084,'Kotyle im quadratum incusum.','cotyle within incuse square.','from CN'),(2085,'Stadtgöttin mit Mauerkrone und im langen Gewand, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera haltend, die Linke auf das Zepter gestützt.','Turreted city goddess standing facing, head left, wearing long garment, holding patera in outstretched right hand, left resting on sceptre.','from CN'),(2086,'Demeter mit Ährenkranz und Schleier nach links auf einem Altar sitzend, in der Rechten Ähren, die Linke auf die lange Fackel gestützt. Bildleiste. Perlkreis.','Veiled Demeter seated left on altar, wearing corn wreath, holding ears of corn in right hand, left