haros; im Feld links, Thyrsos; darüber Mondsichel.','Cantharus; in left field, thyrsus, above, crescent.','from CN'),(2102,'Kantharos; im Feld links, Thyrsos, im Feld rechts, Mondsichel','Cantharus; in left field, thyrsus, in right field, crescent.','from CN'),(2103,'Kaiser (Geta) in Kriegsbekleidung, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera, in der Linken Speer haltend; hinter ihm Nike im langen Gewand stehend von vorn, Kopf nach links, den Kaiser mit einem Lorbeerkranz in der Rechten bekränzend, im linken Arm Palmzweig haltend. Bildleiste. Perlkreis.','Emperor (Geta) in military attire standing facing, head left, wearing cuirass and boots, holding patera in outstretched right hand and spear in left hand; behind him Nike standing facing, head left, wearing long garment, crowning emperor with laurel wreath in right hand, holding palm branch in left arm. Ground line. Border of dots.','from CN'),(2104,'Fassade eines tetrastylen Tempels auf doppelter Krepis, Akrotere und Antefixe am Dach; Schild im Giebel; darin Asklepios stehend von vorn, Kopf nach links, in der Rechten Schlangenstab haltend.','Façade of a tetrastyle temple on crepidoma, acroteria and antefixa along roof; shield on pediment; within Asclepius standing facing, head left, holding serpent-staff in right hand.','from CN'),(2105,'Zwei Fackeln dazwischen Altar.','Two torches; inbetween, altar.','from CN'),(2106,'Athena im langen Chiton und mit Helm nach rechts stehend, mit der Rechten einen Baum, um den sich eine Schlange windet, umfassend, in der Linken Speer und Schild haltend. Perlkreis.','Athena standing right, wearing helmet and chiton, in left arm spear and shield; with the right hand touching a tree entwined by serpent. Border of dots.','from CN'),(2108,'Gorgoneion, mit vorgestreckter Zunge und Schlangen, die Haarlocken bilden.','Gorgoneion, tongue protruding, serpents forming curls framing head.','from CN'),(2109,'Greif nach links von ionischem Säulenkapitell springend,