chts davon Kerykeion. Perlkreis.','Ithyphallic herm, seen from front; to left, grain ear; to right, caduceus. Border of dots.','from CN'),(2128,'Amphora.','Amphora.','from CN'),(2129,'Kybele mit Polos nach links thronend, in der vorgestreckten Rechten Patera, im linken Arm punktiertes Zepter haltend; unter dem Thron, Löwe nach links sitzend.','Cybele enthroned left, wearing a polos, holding patera in outstretched right hand and pelleted sceptre in left arm; under throne, lion seated, left.','from CN'),(2130,'Nackter Silen mit Bart und Glatze nach rechts schreitend, eine Nymphe im langen Gewand und mit gebundenen Haaren entführend.','Nude, bald and bearded silenus advancing right, carrying off in his arms a nymph with bound hair, wearing garment.','from CN'),(2131,'Kopf des (jugendlichen) Dionysos nach rechts, mit Efeukranz von fünf Blättern und zwei Früchten, Haarband, seitlich eingerollter Frisur, die einen Knoten am Nacken bildet, mit zwei Locken auf dem Rücken.','Head of (youthful) Dionysus, right, wearing taenia and ivy wreath with five leaves and two fruits. Hair dress rolled in the back and with two curls falling on his back.','from CN'),(2132,'Greif nach links sitzend, die rechte Vordertatze erhoben, mit runden, aufgerichteten Palmettenflügeln, geschwungenem Schwanz und geöffnetem Schnabel; unter der rechten Vorderpfote bärtiger, dickbäuchiger Silen tanzend, Kopf nach links, linkes Bein und rechte Hand erhoben. Perlkreis.','Griffin seated left, right forepaw raised, with palmette-like curved upwards wings, tail curling and open beak; below right forepaw, bearded, pot-bellied Silenus dancing, head left, left leg and raising right arm. Border of dots.','from CN'),(2133,'Greif nach links sitzend, die rechte Vordertatze erhoben, mit einfachen gebogenen Flügeln, geschwungenem Schwanz und geöffnetem Schnabel, die Zunge hervorgestreckt; davor Weintraube am Zweig.','Griffin seated left, right forepaw raised, with plain curved wings, tail curling and open beak with to