reis.','Radiate Helios standing facing, head left, wearing a chlamys and boots, raising right arm, holding a short torch in left arm. Ground line. Border of dots.','from CN'),(2225,'Geflügelte Nemesis (Dikaiosyne) stehend von vorn, Kopf nach links, in der Rechten Waage, in der gesenkten Linken die Zügel (?) haltend; links zu Füßen, Rad. Bildleiste. Perlkreis.','Winged Nemesis (Aequitas) standing facing, head left, holding scales in right hand and reins (?) in lowered left hand; to left at her feet, wheel. Groundline. Border of dots.','from CN'),(2226,'Artemis im langen Gewand und mit wehendem Mantel stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Bogen haltend und in der Linken Pfeil vom Köcher am Rücken ziehend; vor ihr Hirsch nach links stehend, Kopf nach oben. Bildleiste. Perlkreis.','Artemis standing facing, head left, wearing long garment and fluttering chlamys, holding bow in right hand, drawing arrow with left hand from quiver at shoulder; at her feet, stag standing left, looking upwards. Ground line. Border of dots.','from CN'),(2227,'Fassade eines tetrastylen Tempels auf Krepis mit gedrehten ionischen Säulen, Architrav, Schild und Speer im Giebel und Akroteren am Dach; darin Nike stehend von vorn, Kopf nach links, im linken Arm Palmzweig haltend. Perlkreis.','Façade of a tetrastyle temple on crepidoma with twisted ionic columns, architrave, shield and spear on pediment and acroteria on roof; within Nike standing facing, head left, holding palm branch in left arm. Border of dots.','from CN'),(2228,'Artemis im langen Gewand und mit wehendem Mantel, nach links schreitend, in der vorgestreckten Rechten Bogen, in der Linken einen Pfeil aus dem Köcher am Rücken ziehend; vor ihr nach links stehender Hirsch, Kopf nach oben. Bildleiste. Perlkreis.','Artemis advancing left, wearing long garment and fluttering cloak, holding bow in right hand and drawing arrow from quiver at shoulder with left hand; at side, stag standing left, head upwards. Ground line. Border of dots.','from CN'),(2229,'Artemis im langen Gewand stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Bogen und lange brennende Fackel in der Linken haltend; vor ihr Hirsch nach links stehend, Kopf nach oben. Bildleiste. Perlkreis.','Artemis standing facing, head left, wearing long garment, holding bow in right hand and a long lighted torch in left arm; at her feet, stag standing left looking upwards. Ground line. Border of dots.','from CN'),(2230,'Zur Hälfte geöffnetes Stadttor mit gewölbtem Türsturz, flankiert von zwei Türmen; darüber Galerie mit fünf Bögen mit Statuen darin.','City gate with arched half-open door, flanked by two towers; above, gallery of five arches with statues inside.','from CN'),(2231,'Weintraube mit Blättern und Ranken; im Feld unten links, Monogramm.','Bunch of grapes on vine branch; in left field, below, monogram.','from CN'),(2233,'Nemesis stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Ellenmaß, in der gesenkten Linken die Zügel haltend; zu ihren Füßen links Rad. Bildleiste. Perlkreis.','Nemesis standing facing, head left, holding cubit-rule in right hand and reins in left hand; at her feet, left, wheel. Ground line. Border of dots.','from CN'),(2234,'Nackter Apollon nach rechts stehend, halb von hinten gesehen, über der linken Schulter Gewand, in gesenkter Rechter Lorbeerzweig haltend; links hinter ihm, Lorbeerbaum, rechts vor ihm, Bogen und Köcher. Bildleiste. Perlkreis.','Nude Apollo standing right, seen from behind, cloth over left shoulder, holding laurel-branch in lowered right hand; at left, behind him, laurel tree and at right, in front of him, bow and quiver. Ground line. Border of dots.','from CN'),(2235,'Geschlossenes Stadttor, flankiert von zwei Helmtürmen.','Closed city gate, flanked by two round towers with conical roofs.','from CN'),(2236,'Nackter Dionysos stehend von vorn, nach links blickend, in der vorgestreckten Rechten Weintraube, im linken Arm Chlamys mit herabhängenden Ende