ing on long sceptre. Border of dots.','from CN'),(2514,'Demeter mit Stephane nach rechts stehend, den rechten Arm auf lange Fackel gestützt, in der vorgestreckten Linken Ähren haltend. Kurze Bildleiste.','Demeter standing right, wearing stephane, holding torch in right hand and ears of corn in left hand. Short ground line.','from CN'),(2515,'Apollon? stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera haltend, in der Linken sich auf eine Säule stützend.','Apollo? standing facing, head left, holding patera in outstretched right hand and resting his left arm on column.','from CN'),(2516,'Geflügelte Nike stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Kranz, in der gesenkten Linken Palmzweig. Bildleiste. Perlkreis.','Winged Nike standing facing, head left, holding wreath in outstretched right hand and palm branch in lowered left arm. Ground line. Border of dots.','from CN'),(2517,'Nackter Hermes mit Petasos nach links, Geldbörse und Kerykeion haltend.','Nude Hermes standing left, wearing petasus, holding purse and caduceus.','from CN'),(2519,'Nemesis stehend von vorn, Kopf nach links, mit Kalathos, in der Rechten kurzes Ellenmaß, im linken Arm das Füllhorn; zu ihren Füßen, links, Rad.','Nemesis standing facing, head left, wearing kalathos, holding a short cubit-rule in right hand, cornucopia in left arm; at her feet, left, wheel.','from CN'),(2521,'Schiff mit geblähtem Segel nach rechts auf dem Wasser; an Bord sechs Ruderern. Perlkreis.','Galley, under full sail, sailing right, in waters; on board, six rowers. Border of dots.','from CN'),(2522,'Artemis nach rechts schreitend, in der Linken Bogen haltend und in der Rechten Pfeil vom Köcher am Rücken ziehend; zu ihren Füßen Hund nach rechts laufend. Kurze Bildleiste. Perlkreis.','Artemis advancing right, holding bow in left hand, drawing arrow with right hand from quiver at shoulder; at her feet, hound running right. Short ground line. Border of dots.','from CN'),(2523,'Asklepios stehend von vorn, Kopf nach rechts, mit der Rechten sich auf den Schlangenstab stützend, über dem links Arm Gewand. Bildleiste. Perlkreis.','Asclepius standing facing, head right, holding serpent-staff in right hand. Ground line. Border of dots.','from CN'),(2524,'Serapis mit Kalathos stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera, im linken Arm das Füllhorn.','Serapis standing facing, head left, wearing kalathos, holding in outstretched right hand patera and cornucopia in left arm.','from CN'),(2525,'Weibliche Figur (Nymphe?) nach links auf einem Fels sitzend, die rechte Hand an den Kopf führend, den linken Arm auf den Fels gestützt. Perlkreis.','Female figur (nymph?), seated right on rock, raising right arm to her head, resting left arm on rock. Border of dots.','from CN'),(2526,'Die Kapitolinische Trias. In der Mitte Zeus mit nacktem Oberkörper frontal thronend, in der vorgestreckten Rechten Patera und in der Linken Zepter haltend; unten zu seinen Füßen Adler nach rechts mit geöffneten Flügeln. Links von Zeus Hera im langen Gewand nach links stehend, in der vorgestreckten Rechten Patera und in der Linken Zepter haltend. Rechts von ihm Athena im langen Gewand nach links stehend, in der Rechten sich auf einem am Boden abgestellten Schild stützend und in der Linken den nach unten gerichteten Speer haltend. Perlkreis.','The Capitoline Trias. In the middle Zeus enthroned, holding patera in outstretched right hand, left resting on sceptre; eagle standing at feet facing, head right, with spread wings. To his left Hera standing facing, head left, holding patera in outstretched right hand, left resting on sceptre. To his right Athena standing facing, head left, wearing long garment, resting right hand on shield, holding inverted spear in left arm. Border of dots.','from CN'),(2527,'Zeus mit nacktem Oberkörper stehend von vorn, Kopf nach rechts, in der gesenkten Rechten Blitzbündel haltend, die Linke auf das lange Zepter gestützt. Bildleiste. Perlkreis.','Zeus standing facing, head right, naked to waist, holding thunderbolt in lowered right hand, left resting on long sceptre. Ground line. Border of dots.','from CN'),(2528,'Genius stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden Altar haltend, im linken Arm das Füllhorn. Perlkreis.','Genius standing facing, head left, holding patera in outstretched right hand over lighted altar and cornucopia in left arm. Border of dots.','from CN'),(2529,'Brustbild des Caracalla mit Strahlenkrone nach rechts, von hinten gesehen.','Radiate and cuirassed bust of Caracalla, right, seen from behind.','from CN'),(2530,'Tyche im langen Gewand stehend von vorn, Kopf nach links, in der Rechten Globus haltend und in der Linken sich auf einen nach unten gerichteten Steuerruder stützend. Perlkreis.','Tyche standing facing, head left, wearing long garment, holding globe in right hand and rudder downwards in left hand. Border of dots.','from CN'),(2531,'Rechts, Asklepios stehend von vorn, Kopf nach links, sich mit der Rechten auf den Schlangenstab stützend; links, Hygieia im langen Gewand nach rechts stehend, in der vorgestreckten Rechten Patera, aus der die Schlange in ihrer Linken frisst. Perlkreis.','At right, Asclepius standing facing, head left, leaning on serpent-staff with right hand; at left, Hygieia standing right, feeding serpent held in left arm from patera in outstretched right hand. Border of dots.','from CN'),(2532,'Athena stehend von vorn, Kopf nach rechts, im langen Gewand und mit Helm, in der Rechten den nach unten gerichteten Speer haltend und in der Linken sich auf einen am Boden abgestellten Schild stützend.','Athena standing facing, head right, wearing a helmet and long garment, holding inverted spear in right hand and left resting onshield.','from CN'),(2533,'Die drei Chariten (oder Nymphen?) stehend, die links von vorn, Kopf nach links, die mittlere von hinten, Kopf nach rechts, die Rechte von vorn, Kopf nach rechts; an den S