en Patera über eine halb nach links geöffnete cista mystica, aus der sich eine Schlange windet, die Linke auf die lange Fackel gestützt. Bildleiste. Perlkreis.','Veiled Demeter standing facing, head left, wearing corn wreath and long garment, holding patera in outstretched right hand over cista mystica with half-open lid, out of which serpent creeps left, and long torch in left arm. Ground line. Border of dots.','from CN'),(2573,'Nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über Dreifuß haltend, in der gesenkten Linken Lorbeerzweig. Bildleiste. Perlkreis.','Nude laureate Apollo standing facing, head left, holding patera over tripod in right hand and laurel-branch in lowered left hand. Ground line. Border of dots.','from CN'),(2574,'Nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Lorbeerzweig, in der gesenkten Linken Pfeil. Bildleiste. Perlkreis.','Nude laureate Apollo standing facing, head left, holding laurel-branch in outstretched right hand and bow in lowered left hand. Ground line. Border of dots.','from CN'),(2576,'Athena stehend von vorn, Kopf nach links, mit Helm mit Helmbusch und im langen Gewand, in der Rechten den am Boden abgestellten Schild haltend und in der Linken sich auf den Speer stützend. Bildleiste. Perlkreis.','Athena standing facing, head left, wearing crested helmet and long garment, holding shield in right hand and left resting on spear. Ground line. Border of dots.','from CN'),(2578,'Nackter Dionysos stehend von vorn, Kopf nach links, mit Efeukranz und in Stiefeln, in der Rechten den Kantharos, die Linke auf den mit Bandschleife geschmückten Thyrsos gestützt; vor ihm, Panther nach links sitzend, Kopf nach rechts, mit erhobener Vordertatze. Bildleiste. Perlkreis.','Nude Dionysus standing facing, head left, wearing ivy wreath and boots, holding cantharus in right hand and filleted thyrsus in left arm; at left, a panther seated left, head right, with raised forepaw. Ground line. Border of dots.','from CN'),(2579,'Homonoia mit Kalathos stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera und im linken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Homonoia standing facing, head left, wearing kalathos, holding patera in outstretched right hand and cornucopia in left arm. Ground line. Border of dots.','from CN'),(2580,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer und in Stiefeln stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Blitzbündel haltend, die Linke auf das lange Zepter gestützt; hinter ihm Nike nach links stehend, den Kaiser mit einem Lorbeerkranz in der Rechten bekränzend, im linken Arm Palmzweig haltend. Bildleiste. Perlkreis.','Emperor (Caracalla) in military attire standing facing, head left, wearing cuirass and boots, holding thunderbolt in outstretched right hand, left resting on long sceptre; behind him, Nike standing left, crowning emperor with laurel wreath in right hand, holding palm branch in left arm. Ground line. Border of dots.','from CN'),(2581,'Fassade eines tetrastylen Tempels auf Krepis mit geschmücktem Giebel und Akroteren am Dach; darin nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der gesenkten Linken Pfeil. Bildleiste. Perlkreis.','Façade of tetrastyle temple on crepidoma with ornated pediment and acroteria on roof; within nude laureate Apollo standing facing, head left, holding bow in lowered left hand. Ground line. Border of dots.','from CN'),(2582,'Fassade eines Rundtempels mit geschmücktem Giebel und Akroteren am Dach; darin nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über flammenden und bekränzten Altar haltend, in der gesenkten Linken Lorbeerzweig. Bildleiste. Perlkreis.','Façade of round temple with ornated pediment and acroteria on roof; within nude laureate Apollo standing facing, head left, holding patera in outstretched right hand over lighted and garlanded altar and laurel-branch in lowered left hand. Ground line. Border of dots.','from CN'),(2583,'Fassade eines tetrastylen Tempels mit geschmücktem Giebel und Akroteren am Dach, auf einer hohen Basis mit Girlanden; darin Artemis nach rechts schreitend, mit kurzem wehendem Chiton und in Stiefeln, in der Linken Bogen haltend und in der Rechten Pfeil aus dem Köcher am Rücken ziehend; das Ganze zwischen zwei Bäumen, hinter dem linken Baum, Hirsch nach links springend, hinter dem rechten Baum, Hund? nach rechts springend. Bildleiste. Perlkreis.','Façade of a tetrastyle temple with ornated pediment and acroteria on roof, temple standing on high garlanded base; within Artemis advancing right, wearing short fluttering chiton and boots, holding bow in left hand and drawing arrow from quiver at shoulder with right hand; all between two trees, behind the left tree, deer leaping to left and behind the right tree, hound? leaping to right. Ground line. Border of dots.','from CN'),(2584,'Geschlossenes Stadttor, mit geradem Türsturz, flankiert von zwei zinnenbewehrten Türmen, ein dritter dahinter in der Mitte; im Abschnitt Flußgott nach links gelagert, den rechten Arm erhoben. Bildleiste. Perlkreis.','Closed city gate with straight lintel, flanked by two crenellated towers, third crenellated tower rising from center; in exergue, river-god reclining left, raising right arm. Ground line. Border of dots.','from CN'),(2585,'Nackter Harpokrates stehend von vorn, Kopf nach links, die Rechte zum Mund führend, im Iinken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Nude Harpocrates standing facing, head left, raising right arm finger to lips, holding cornucopia. Ground line. Border of dots.','from CN'),(2586,'Nackter Dionysos stehend von vorn, Kopf nach links, mit Efeukranz und in Stiefeln, in der gesenkten Rechten Weintraube, die Linke auf den Thyrsos gestützt. Bildleiste. Perlkreis.','Nude Dionysus standing facing, head left, wearing ivy wreath and boots, holding bunch of grapes in lowered right hand and thyrsus in left arm. Ground line. Border of dots.','from CN'),(2587,'Hades-Serapis nach links thronend mit Kalathos und nacktem Oberkörper; die Rechte über Kerberos vor ihm vorgestreckt, in der Linken Zepter haltend. Bildleiste. Perlkreis.','Hades-Serapis enthroned left, bare-chested,wearing kalathos, extending right hand over Cerberus, left, holding sceptre in left arm. Ground line. Border of dots.','from CN'),(2588,'Kaiser (Geta) mit Panzer, wehendem Paludamentum und in Stiefeln auf einem Pferd, in der erhobenen Rechten den schräg nach unten gerichteten Speer gegen einen von einem Hund gejagten Eber nach rechts schleudernd. Bildleiste. Perlkreis.','Emperor (Geta) riding right on horseback, wearing cuirass, fluttering paludamentum and boots, brandishing transverse spear in raised right hand towards boar hunted by hound to right. Ground line. Border of dots.','from CN'),(2589,'Kaiser (Geta) in Kriegsbekleidung, stehend von vorn, Kopf nach rechts, in der Rechten den nach unten gerichteten Speer und im linken Arm Parazonium haltend; er setzt den linken Fuß auf den Rücken eines vor ihm nach rechts kniender Gefangener, Kopf nach links, mit phrygischer Mütze und hinter dem Rücken gefesselten Händen. Bildleiste. Perlkreis.','Emperor (Geta) in military attire standing facing, head right, wearing cuirass and boots, holding transverse spear in right arm and parazonium in left arm; his left foot on the back of a captive in front of him kneeling right, head left, with Phrygian cap and bound arms behind back. Ground line. Border of dots.','from CN'),(2590,'Kaiser (Geta) in Kriegsbekleidung, stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen bekränzten flammenden Altar haltend, die Linke auf das Zepter gestützt. Bildleiste. Perlkreis.','Emperor (Geta) in military attire standing facing, head left, wearing cuirass, fluttering paludamentum and boots, holding patera in outstretched right hand over lighted and garlanded altar, left resting on sceptre. Ground line. Border of dots.','from CN'),(2591,'Fassade eines tetrastylen Tempels auf Krepis mit geschmücktem Giebel und Akroteren am Dach; darinn nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera und in der gesenkten Linken Pfeil. Bildleiste. Perlkreis.','Façade of tetrastyle temple on crepidoma with ornated pediment and acroteria on roof; within nude laureate Apollo standing facing, head left, holding patera in outstretched right hand and bow in lowered left hand. Ground line. Border of dots.','from CN'),(2592,'Nackter, geflügter Eros (Todesgenius) mit gekreuzten Beinen nach rechts stehend, sich auf die umgedrehte Fackel auf einem bekränzten Altar stützend. Bildleiste. Perlkreis.','Nude winged Eros in attitude of Thanatus standing right, legs crossed, resting on torch set on garlanded altar. Ground line. Border of dots.','from CN'),(2593,'Brustbild des bärtigen Geta nach rechts mit Lorbeerkranz, Schuppenpanzer und Paludamentum; auf dem Rücken das Gorgoneion. Perlkreis.','Laureate bust of bearded Geta, right, wearing scale cuirass and paludamentum; on back gorgoneion. Border of dots.','from CN'),(2594,'Bärtiger Flussgott mit nacktem Oberkörper nach links gelagert, Kopf nach rechts, in der leicht erhobenen Rechten Schilfzweig, den linken Arm auf das Quellgefäß gestützt; im Hintergrund darüber auf einer Anhöhe Stadtmauer, flankiert von zwei Türmen, und in der Mitte ein dritter; die Türme sind mit Zinnen bewehrt. Perlkreis.','Bearded river-god reclining left, head right, resting left arm on water-urn, holding reed in raised right hand; in background above on hill, city gate with three towers. Border of dots.','from CN'),(2595,'Bärtiger Flussgott (Istros) mit nacktem Oberkörper nach links gelagert, in der Linken Schilfzweig, die auf das Quellgefäß gestützt; im Hintergrund darüber Stadttor auf Anhöhe, flankiert von zwei Türmen, und in der Mitte ein dritter; die Türme sind mit Zinnen bewehrt. Perlkreis.','Bearded river-god (Istros) reclining left, holding branch in left hand, which is resting on water-urn; in background above on hill, city gate with three towers. Border of dots.','from CN'),(2596,'Nike im langen Gewand nach rechts stehend, in der erhobenen Rechten den Kranz, im linken Arm den Palmzweig. Bildleiste. Perlkreis.','Nike standing right, wearing long garment, holding wreath in outstretched right hand and palm branch in left arm. Ground line. Border of dots.','from CN'),(2598,'Zeus (Aëtophoros) im langen Gewand nach links thronend, in der vorgestreckten Rechten einen Adler nach rechts und in der Linken Zepter haltend; im inneren linken Feld Monogramm.','Zeus (Aëtophoros) enthroned left, wearing long garment, holding eagle, right, in outstretched right hand and sceptre in left hand; in inner left field, monogram.','from CN'),(2599,'Athena (Nikephoros) nach links thronend, in der vorgestreckten Rechten Nike haltend; Speer diagonal im Hintergrund; links Arm hinten am Schild mit Stern; im links inneren Feld Kultbild des Hermes Perpheraios auf Thron von vorn.','Athena (Nikephoros) enthroned to left, holding Nike in outstretched right hand; left arm resting on shield behind, decorated with a star; in background, transverse spear; in inner left field, cult image of Hermes Perpheraios facing.','from CN'),(2600,'Nackter Hermes stehend von vorn, Kopf nach links, in der Rechten Beutel und in der Linken Kerykeion haltend; links daneben, Widder.','Nude Hermes standing facing, head left, holding purse in right hand and caduceus in left hand; to left, ram.','from CN'),(2601,'Zeus (Aëtophoros) im langen Gewand nach links thronend, in der vorgestreckten Rechten einen Adler nach rechts und in der Linken Zepter haltend; unter dem Thron korinthischer Helm mit Helmbusch nach links.','Zeus (Aëtophoros) enthroned left, wearing long garment, holding eagle, right, in outstretched right hand and sceptre in left hand; below throne, crested Corinthian helmet, left.','from CN'),(2602,'Zeus (Aëtophoros) im langen Gewand nach links thronend, in der vorgestreckten Rechten einen Adler nach rechts und in der Linken Zepter haltend; im inneren linken Feld Monogramm; unter dem Thron korinthischer Helm mit Helmbusch.','Zeus (Aëtophoros) enthroned left, wearing long garment, holding eagle, right, in outstretched right hand and sceptre in left hand; in inner left field, monogram; below throne, crested Corinthian helmet.','from CN'),(2603,'Greif nach links sitzend, die rechte Vordertatze erhoben, mit einfachen gebogenen Flügeln, geschwungenem Schwanz und geöffnetem Schnabel, die Zunge hervorgestreckt. Linienkreis.','Griffin seated left, right forepaw raised, with plain curved wings, tail curling and open beak with tongue protruding. Linear border.','from CN'),(2605,'Nackter Krieger mit Pilos nach rechts angreifend; in der vorgestreckten Linken Schild und in der Rechen Speer wagerecht haltend; im Linienquadrat und quadratum incusum.','Naked warrior attacking right, wearing pilos, holding shield in outstretched left hand and spear in right hand to attack; within linear square and incuse square.','from CN'),(2607,'Zeus (Aëtophoros) im langen Gewand nach links thronend, in der vorgestreckten Rechten einen Adler nach rechts und in der Linken Zepter haltend; im inneren linken Feld korinthischer Helm mit Helmbusch und darüber und darunter Monogramm.','Zeus (Aëtophoros) enthroned left, wearing long garment, holding eagle, right, in outstretched right hand and sceptre in left hand; in inner left field, crested Corinthian helmet, right, and monogram above and below.','from CN'),(2608,'Zeus (Aëtophoros) im langen Gewand nach links thronend, in der vorgestreckten Rechten einen Adler nach rechts und in der Linken Zepter haltend; im inneren linken Feld Monogramm; unter dem Thron Ähre nach rechts','Zeus (Aëtophoros) enthroned left, wearing long garment, holding eagle, right, in outstretched right hand and sceptre in left hand; in inner left field, monogram; below throne, ear of corn to right.','from CN'),(2609,'Ziegenbock nach rechts stehend; rechts unter dem Bart, Fliege nach rechts; im quadratum incusum.','Goat standing right; to right below beard, fly to right; all within incuse square.','from CN'),(2610,'Ziegenbock nach rechts stehend; davor, undeutliches Beizeichen; im quadratum incusum.','Goat standing right; in front, uncertain mintmark; within incuse square.','from CN'),(2611,'Diagonales Kerykeion im quadratum incusum.','Transverse caduceus within incuse square.','from CN'),(2612,'Ziegenbock nach rechts stehend; rechts unter dem Bart, Traube; in vertieftem Feld.','Goat standing right; to right below beard, bunch of grapes; within incuse field.','from CN'),(2613,'Ziegenbock nach rechts stehend; rechts unter dem Bart, Efeublatt; im quadratum incusum.','Goat standing right; to right below beard, ivy leaf; all within incuse square.','from CN'),(2614,'Ziegenbock nach rechts stehend; rechts unter dem Bart, Silenskopf von vorn; im quadratum incusum.','Goat standing right; to right below beard, head of Silenus facing; all within incuse square.','from CN'),(2615,'Tetrastyler Rundtempel mit einem konischen Dach. Beiderseits des Tempels je eine Reiterstatue auf einer Basis.','Façade of round temple with four columns and conical roof. On both sides of the temple an equestrian statue on a basis.','from CN'),(2616,'Ziegenbock nach rechts stehend; rechts unter dem Bart, achtstrahliger Stern und Mondsichel nach rechts; im quadratum incusum.','Goat standing right; to right below beard, star with eight rays and crescent to right; all within incuse square.','from CN'),(2617,'Ziegenbock nach rechts stehend; rechts unter dem Bart eine Mondsichel nach rechts; im quadratum incusum.','Goat standing right; to right below beard, crescent to right; all within incuse square.','from CN'),(2618,'Ziegenbock nach rechts stehend; rechts unter dem Bart, Krebs; im quadratum incusum.','Goat standing right; to right below bear