from CN'),(2637,'Brustbild des Septimius Severus mit Lorbeerkranz nach rechts. Perlkreis.','Laureate bust of Septimius Severus, right. Border of dots.','from CN'),(2638,'Kopf des Septimius Severus mit Lorbeerkranz nach rechts. Perlkreis.','Laureate head of Septimius Severus, right. Border of dots.','from CN'),(2639,'Adler stehend von vorn, Kopf nach rechts, mit leicht geöffneten Flügeln, im Schnabel Kranz haltend. Bildleiste. Perlkreis.','Eagle standing facing, slightly left, head right, wings half-spread, holding wreath in beak. Ground line. Border of dots.','from CN'),(2640,'Brustbild der Iulia Domna nach rechts mit Gewand und Diadem. Perlkreis.','Diademed and draped bust of Julia Domna, right. Border of dots.','from CN'),(2641,'Ethnikon im unten gebundenen Eichenkranz. Perlkreis.','Ethnic in two lines within oak wreath, bound at bottom. Border of dots.','from CN'),(2642,'Helios mit Strahlenkrone nach rechts, die rechte Hand erhoben, in der linken Hand Peitsche haltend. Bildleiste. Perlkreis.','Radiate Helios standing right, raising right arm, holding chlamys and whip in left hand. Ground line. Border of dots.','from CN'),(2643,'Nackter Apollon stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera und in der Linken Lorbeerzweig haltend.','Nude Apollo standing facing, head left, holding patera in outstretched right hand and laurel-branch in left hand.','from CN'),(2644,'Eros nach auf nach rechts schreitenden Löwen sitzend. Bildleiste.','Eros riding on lion stepping right. Ground line.','from CN'),(2645,'Brustbild des Macrinus nach rechts.','Bare-headed bust of Macrinus, right.','from CN'),(2646,'Kaiser (Diadumenian) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln, nach links stehend; dahinter Nike, den Kaiser mit Lorbeerkranz in der Rechten bekränzend. Bildleiste. Perlkreis.','Emperor (Diadumenian) in military attire standing left, wearing cuirass, fluttering paludamentum and boots; behind him Nike standing left, crowning emperor with laurel-wreath in right hand. Ground line. Border of dots.','from CN'),(2648,'Nike nach rechts schreitend, in den vorgestreckten Händen Tropaion haltend.','Nike advancing right, holding in outstretched hands a trophy.','from CN'),(2650,'Apollon (Iatros) stehend von vorn, Kopf nach links, Schlangenstab in der Rechten haltend, die Linke in die Hüfte gestemmt. Bildleiste.','Apollo (Iatros) standing facing, head right, holding serpent-staff in right hand, left hand on hip. Ground line.','from CN'),(2651,'Brustbild des bärtigen Caracalla nach rechts mit Lorbeerkranz und Panzer. Perlkreis.','Laureate and cuirassed bust of bearded Caracalla, right. Border of dots.','from CN'),(2652,'Apollon (Iatros) stehend von vorn, Kopf nach links, Schlangenstab in der Rechten haltend, die Linke in die Hüfte gestemmt, daneben Eros, den rechten Arm erhoben. Bildleiste. Perlkreis.','Apollo standing facing, head left, holding serpent-staff in right hand, left hand on hip, at right side Eros raising right arm. Ground line. Border of dots.','from CN'),(2653,'Aphrodite mit Stephane stehend von vorn, Kopf nach rechts, die Rechte vor der Brust, die Linksevor der Scham; zu ihren Füßen Delphin nach unten.','Nude Aphrodite standing facing, head right, wearing stephane, covering her breasts with right hand and pudenda with left hand; at her feet, dolphin downwards.','from CN'),(2654,'Die drei Chariten (oder Nymphen?), die links und rechts stehend, von vorn, die mittlere in hockender Stellung, Kopf nach rechts. Bildleiste. Perlkreis.','The three Charites (or Nymphs?), nude, left and right standing facing, middle seated, head right. Ground line. Border of dots.','from CN'),(2655,'Asklepios nach links thronend, in der vorgestreckten Rechten Patera, in der Linken den Schlangenstab haltend. Bildleiste. Perlkreis.','Asclepius enthroned left, holding patera in outstretched right hand and serpent-staff in left hand. Ground line. Border of dots.','from CN'),(2656,'Hygieia stehend von vorn, Kopf nach rechts, in der Linken Patera, aus der die Schlange in ihrer rechts frisst. Perlkreis.','Hygieia standing facing, head right, feeding serpent held in right arm from patera in outstretched left hand. Border of dots.','from CN'),(2657,'Dioskur nach links stehend; darüber ein fünfstrahliger Stern, den rechten Arm erhoben und Speer in der Linken haltend. Perlkreis.','Dioscur standing left, raising right arm, holding spear in left arm; above, star with five rays. Border of dots.','from CN'),(2658,'Brustbild des bärtigen Caracalla nach rechts mit Lorbeerkranz und Schuppenpanzer. Perlkreis.','Laureate bust of bearded Caracalla, right, wearing scale cuirass. Border of dots.','from CN'),(2659,'Bärtiger Flussgott (Oiskos) nach links gelagert, Kopf nach rechts, in der erhobenen Rechten Schilfrohr haltend, den linken Arm auf das Quellgefäß gestützt. Perlkreis.','Bearded river-god (Oiskos) reclining left, head right, holding reed in raised right hand, resting left arm on water-urn. Border of dots.','from CN'),(2661,'Kybele mit Mauerkrone nach links auf einem nach links springenden Löwen sitzend, den rechten Arm auf dem Tympanon, im linken Arm Zepter haltend. Bildleiste.','Turreted Cybele seated left, on lion jumping left, holding tympanum in right hand, left resting on long sceptre. Ground line.','from CN'),(2663,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln nach links stehend, in der Rechten Parazonium haltend, den linken Arm auf das Zepter gestützt; er setzt den rechten Fuß auf den Rücken eines vor ihm nach links knienden Gefangenen, Kopf nach rechts, mit phrygischer Mütze und hinter dem Rücken gefesselten Händen; hinter ihm Nike mit Kalathos, den Kaiser mit einem Lorbeerkranz in der Rechten bekränzend, im linken Arm Palmzweig haltend. Bildleiste. Perlkreis.','Emperor (Caracalla) in military attire standing left, wearing cuirass, fluttering paludamentum and boots, holding parazonium in right hand and sceptre in left hand; his right foot on the back of a captive kneeling left, head right, with Phrygian cap and bound arms behind back; behind him, Nike standing left, crowning emperor with laurel wreath in right hand, left resting on sceptre. Ground line. Border of dots.','from CN'),(2664,'Brustbild des Caracalla nach links mit Lorbeerkranz, Panzer und Paludamentum, mit nach vorn gerichtetem Speer und Schild mit Gorgoneion. Perlkreis.','Laureate bust of Caracalla, left, wearing cuirass and paludamentum, holding spear pointed forwards and shield with gorgoneion. Border of dots.','from CN'),(2665,'Kaiser (Caracalla) in Kriegsbekleidung mit Panzer, wehendem Paludamentum und in Stiefeln nach rechts auf einem Pferd reitend, den rechten Arm erhobenn. Bildleiste. Perlkreis.','Emperor (Caracalla) in military attire riding right on horseback, wearing cuirass, fluttering paludamentum and boots, raising right arm. Ground line. Border of dots.','from CN'),(2666,'Adler stehend von vorn auf einem Altar, Kopf nach links, mit geöffneten Flügeln und Kranz im Schnabel. Perlkreis.','Eagle standing on altar facing, head left, wings spread, holding wreath in beak. Border of dots.','from CN'),(2667,'Schlange mit nach links gewandtem Kopf, fünffach gewunden, sich emporringelnd. Bildleiste. Perlkreis.','Serpent coiling, bent five times, head left. Ground line. Border of dots.','from CN'),(2668,'Brustbild des bärtigen Caracalla mit Lorbeerkranz nach rechts, von hinten gesehen.','Laureate bust of bearded Caracalla, right, seen from behind.','from CN'),(2669,'Ethnikon im unten gebundenen Lorbeerkranz; darüber Kranzjuwel.','Ethnic within laurel wreath, bound at bottom; above, crown juwel.','from CN'),(2670,'Brustbild des jugendlichen Caracalla nach rechts mit Panzer und Paludamentum. Perlkreis.','Bare-headed bust of youthful Caracalla, right, wearing cuirass and paludamentum. Border of dots.','from CN'),(2671,'Kopf der Isis nach rechts, mit lockigen Haaren und Lotosblüte. Perlkreis.','Head of Isis, right, with curly hair, wearing lotus. Border of dots.','from CN'),(2672,'Brustbild des jugendlichen Caracalla nach rechts, von hinten gesehen, mit Lorbeerkranz und Panzer. Perlkreis.','Laureate and cuirassed bust of youthful Caracalla, right, seen from behind. Border of dots.','from CN'),(2673,'Nackter Harpokrates stehend von vorn, Kopf nach links, mit Lotosblüte im Haar, die Rechte zum Mund führend, im Iinken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Nude Harpocrates standing facing, head left, wearing lotus, raising right arm finger to lips, holding cornucopia. Ground line. Border of dots.','from CN'),(2674,'Brustbild des bärtigen Geta nach rechts mit Lorbeerkranz, Panzer und Paludamentum. Perlkreis.','Laureate bust of bearded Geta, right, wearing cuirass and paludamentum. Border of dots.','from CN'),(2676,'Asklepios mit Kalathos, stehend von vorn, Kopf nach rechts, in der Rechten sich auf den Schlangenstab stützend. Bildleiste. Perlkreis.','Asclepius standing facing, head right, wearing kalathos, holding serpent-staff in right hand. Ground line. Border of dots.','from CN'),(2677,'Tyche mit Kalathos nach links auf Felsen sitzend, die Linke darauf ruhend, in der Rechten Ähren haltend; links zu ihren Füßen Flussgott im Wasser nach links schwimmend. Perlkreis.','Tyche seated left on rock, wearing calathus, holding ears of corn in right hand, left resting on rock; to left, at feet, river-god swimming, left. Border of dots.','from CN'),(2679,'Bärtiger Flussgott (Oiskos) nach links gelagert, Kopf nach links, in der erhobenen Rechten Schilfrohr haltend; den linken Arm auf das Quellgefäß gestützt. Bildleiste. Perlkreis.','Bearded river-god (Oiskos) reclining left, head right, holding reed in raised right hand; resting left arm on water-urn. Groundline. Border of dots.','from CN'),(2680,'Nemesis stehend von vorn, Kopf nach links, den rechten Zeigefinger an die Lippen führend, im linken Arm das Füllhorn haltend; links, zu Füßen, Rad. Bildleiste.','Nemesis standing facing, head left, right finger at her mouth, holding cornucopia in left arm; at left, at her feet, wheel. Ground line.','from CN'),(2681,'Adler auf Altar stehend von vorn, Kopf nach rechts, mit halb geöffneten Flügeln und Kranz im Schnabel, zwischen zwei jeweils mit einem achtstrahligen Stern geschmückten Standarten. Perlkreis.','Eagle standing facing on altar, head right, wings half-spread, holding wreath in beak, between two standards, each of them decorated with a star with eight rays. Border of dots.','from CN'),(2682,'Adler auf Altar stehend von vorn, Kopf nach links, mit halb geöffneten Flügeln und Kranz im Schnabel, zwischen zwei jeweils mit vier kleinen Sternen geschmückten Standarten. Perlkreis.','Eagle standing facing on altar, head left, wings half-spread, holding wreath in beak, between two standards, each of them decorated with four small stars. Border of dots.','from CN'),(2683,'Genius mit Kalathos stehend von vorn, Kopf nach links, in der vorgestreckten Rechten Patera über einen flammenden Altar haltend, im linken Arm das Füllhorn. Bildleiste.','Genius standing facing, head left, wearing kalathos, holding patera in outstretched right hand over lighted altar and cornucopia in left arm. Ground line.','from CN'),(2684,'Brustbild des Severus Alexander nach rechts mit Lorbeerkranz und Paludamentum.','Laureate bust of Severus Alexander, right, wearing paludamentum.','from CN'),(2687,'Fassade eines tetrastylen Tempels auf Krepis mit Architrav und mit Akroteren am Dach; darin thronender Zeus, in der vorgestreckten Rechten Patera, in der Linken Zepter. Perlkreis.','Façade of a tetrastyle temple on crepidoma with architrave and acroteria on roof; within Zeus enthroned, holding patera in outstretched right hand, left resting on sceptre. Border of dots.','from CN'),(2688,'Fassade eines hexastylen Tempels auf doppelter Krepis mit korinthischen Säulen, Akroteren am Dach und Schild im Giebelfeld; darin Apollon, nach links stehend, in der gesenkten Rechten Lorbeerzweig haltend, sich in der Linken auf Dreifuß stützend. Perlkreis.','Façade of hexastyle temple on double crepidoma with Corinthian columns, acroteria on roof and clipeus in pediment; inside Apollo standing left, holding laurel-branch in right hand, leaning left arm on tripod. Border of dots.','from CN'),(2689,'Nackter Apollon mit Lorbeerkranz stehend von vorn, Kopf nach links, in der vorgestreckten Rechten den Lorbeerzweig, in der Linken die auf dem Dreifuß stehende Lyra haltend. Bildleiste. Perlkreis.','Nude Apollo standing facing, head left, holding laurel-branch in outstretched right hand and lyre resting on tripod in left hand. Ground line. Border of dots.','from CN'),(2690,'Nackter Apollon stehend von vorn, Kopf nach links, in der gesenkten Rechten einen Lorbeerzweig über einen Altar haltend, in der Linken die Lyra auf einem Dreifuß festhaltend.','Nude Apollo standing facing, head left, holding laurel-branch over altar in lowered right hand and lyre set on tripod with left hand.','from CN'),(2691,'Brustbild der Iulia Mamaea mit Gewand nach rechts. Perlkreis.','Draped bust of Julia Mamaea, right. Border of dots.','from CN'),(2692,'Nemesis stehend von vorn, Kopf nach links, den rechten Zeigefinger an die Lippen führend, im linken Arm Ellenmaß und Gewandzipfel haltend; zu ihren Füßen Rad. Bildleiste.','Nemesis standing facing, head left, right finger at her mouth, holding cubit-rule and ribbon in left arm; at her feet, wheel. Ground line.','from CN'),(2693,'Brustbild der Iulia Mamaea nach rechts mit Diadem und Gewand. Perlkreis.','Diademed and draped bust of Julia Mamaea, right. Border of dots.','from CN'),(2694,'Adler auf Altar stehend von vorn, Kopf nach rechts, mit halb geöffneten Flügeln, zwischen zwei Standarten. Bildleiste. Perlkreis.','Eagle standing facing on altar, head right, wings half-spread, between two standards. Ground line. Border of dots.','from CN'),(2696,'Ethnikon im unten gebundenen Lorbeerkranz.','Ethnic within laurel wreath, bound at bottom.','from CN'),(2697,'Demeter 