nen Zweig haltend, um den sich eine Schlange windet, den linken Arm auf eine Säule abstützend. Perlkreis.','Hygieia standing right, holding branch entwined by serpent held in right arm, left resting on column. Border of dots.','from CN'),(2726,'Nemesis im langen Gewand stehend von vorn, Kopf nach links, in der Rechten Ellenmaß, in der Linken die Zügel haltend; zu ihren Füßen links Rad. Bildleiste. Perlkreis.','Nemesis standing facing, head left, wearing long garment, holding cubit-role in right hand and reins in left hand; at her feet, left, wheel. Ground line. Border of dots.','from CN'),(2728,'Nemesis im langen Gewand stehend von vorn, Kopf nach links, in der Rechten Ellenmaß, im linken Arm das Füllhorn haltend; links zu Füßen, Rad. Bildleiste. Perlkreis.','Nemesis standing facing, head left, wearing long garment, holding cubit-rule in right arm and cornucopia in left arm; to left at her feet, wheel. Ground line. Border of dots.','from CN'),(2730,'Homonoia nach links stehend, in der vorgestreckten Rechten Patera und im linken Arm das Füllhorn haltend. Bildleiste. Perlkreis.','Homonoia standing left, holding patera in outstretched right hand and cornucopia in left arm. Ground line. Border of dots.','from CN'),(2731,'Nackter Zeus stehend von vorn, Kopf nach links, Mantel über linker Schulter, Blitzbündel in gesenkter Rechter, Zepter in der Linken haltend; links zu seinen Füßen Adler nach links stehend, Kopf nach rechts, mit geöffneten Flügeln.','Nude Zeus standing left, head right, cloak over left shoulder, holding thunderbolt in lowered right hand, sceptre in left hand; eagle standing left, head right, wings spread.','from CN'),(2732,'Brustbild des Gordian III. nach links mit Lorbeerkranz, Panzer und Paludamentum, in der Rechten Speer nach vorn haltend, in der Linken Schild haltend. Perlkreis.','Laureate bust of Gordian III, left, wearing cuirass and paludamentum, holding spear in right hand and shield on left arm. Border of dots.','from CN'),(2733,'Delphin nach re