nd standards.','from CN'),(3374,'Adlocutio des Kaisers (Caracalla); Kaiser (Caracalla) in Kriegsbekleidung mit Panzer und Paludamentum nach rechts auf einem Podest stehend, den rechten Arm erhoben, zwischen zwei Prätorianern; vor ihm drei Soldaten nach links stehend, Schild und Speer haltend; dahinter drei Standarten.','Adlocutio of emperor (Caracalla); emperor (Caracalla) in military attire, standing right on platform, wearing cuirass and paludamentum, raising right arm, between two praetorian officers; in front of him, three soldiers standing left, holding shield and spear; behind them, three standards.','from CN'),(3375,'Ares mit Helm nach links, den am Boden stehenden Schild und Speer haltend.','Ares standing left, wearing helmet, holding shield set down at his feet and spear.','from CN'),(3376,'Ares nach links stehend mit Helm und Panzer, sich in der Rechten auf den Schild am Boden vor ihm stützend, in der erhobenen Linken Speer haltend.','Ares standing left, wearing helmet and cuirass, resting on shield set down at his feet with right hand, holding spear in raised left hand.','from CN'),(3377,'Tetrastyler Rundtempel zwischen zwei Bäumen; darin Apollon (Iatros) mit Schlangenstab und kleiner Eros mit erhobener Rechten.','Tetrastyle round temple between two trees; within Apollo (Iatros) holding serpent-staff, and small Eros raising right arm.','from CN'),(3378,'Tetrastyler Rundtempel mit Eck- und Firstaktroterien und Kegeldach auf hoher Basis, zwischen zwei Bäumen; darin Apollon (Iatros) mit Schlangenstab in der Rechten, die Linke in die Hüfte gestemmt; rechts daneben, kleiner Eros mit erhobener Rechten.','Tetrastyle round temple with acroteria on pediment, between two trees; within Apollo (Iatros) holding serpent-staff in right hand, left hand on hip, and small Eros raising right arm.','from CN'),(3379,'Athena nach links mit Eule und Schild; der Schild steht vor ihr am Boden; zu ihren Füßen Altar.','Athena standing left, holding owl and shield set down at her fe