,'Apollon, Asklepios und Hygieia; in der Mitte Apollon mit gekreuzten Beinen nach links, mit Lorbeerzweig in der Rechten, die Linke über eine um den Omphalos ringelnden Schlange erhoben; zu seinen Füßen links Telesphoros; links von ihm Asklepios nach rechts mit Schlangenstab in der Rechten; rechts von ihm Hygieia nach links, die Schlange aus Patera fütternd; im Hintergrund Tyche, thronend, mit Steuerruder und Füllhorn und Zeus mit Blitzbündel in der Linken, einander zugewandt.','Apollo, Asclepius and Hygieia; in the centre, nude Apollo standing left, legs crossed, holding laurel-branch, left hand over serpent coiling around omphalos; at his feet, left, Telesphorus ; to left, Asclepius standing right, holding serpent-staff in right hand; between them Telesphorus; to right, Hygieia standing left, feeding serpent from patera; in the background, Tyche, enthroned, holding rudder and cornucopia and Zeus holding thunderbolt.','from CN'),(3872,'Apollon, Asklepios und Hygieia; in der Mitte nackter Apollon stehend von vorn, Kopf nach links, linkes Bein über rechtes gekreuzt, in der Rechten Lorbeerzweig, die Linke über eine sich um einen Omphalos ringelnde Schlange rechts von ihm vorgestreckt; zu seinen Füßen links Telesphoros mit Mantel und Kapuze; links von Apollon Asklepios im langen Gewand nach rechts stehend, in der Rechten sich auf den Schlangenstab stützend, die Linke in die Hüfte gestemmt; rechts von Apollon, Hygieia im langen Gewand nach links stehend, die Schlange im rechten Arm aus der Patera in ihrer Linken fütternd; im Hintergrund Tyche nach links thronend, in der Rechten langes Steuerruder und im linken Arm das Füllhorn haltend, und nackter Zeus nach links schreitend, in der Rechten den Blitzbündel schleudernd.','Apollo, Asclepius and Hygieia; in the centre, nude Apollo standing facing, head left, left leg crossed over right, holding laurel-branch in right hand, left hand over serpent coiled around omphalos at his feet to right; at his feet to left, Telesphorus w