 vorgestreckten Rechten Patera haltend, die Linke auf den Schlangenstab gestützt; vor ihm weibliche Gestalt, die eine Flüssigkeit in Patera gießt, die Linke zum Gesicht erhoben; im Hintergrund Baum. Perlkreis.','Asclepius, Hygieia and female figure; to left, Hygieia enthroned right, wearing long garment; behind her Telesphorus wearing hooded mantle; to right, Asclepius enthroned left, holding patera in outstretched right hand, resting left arm on serpent-staff; in front of him female figure pouring liquid into patera, raising left arm to her face; in the background, tree. Border of dots.','from CN'),(3876,'Tropaion; links davon Nike; rechts davon Kaiser (Philippus Arabs) mit Speer in der Linken; am Boden zwei Gefangene.','Trophy; to left, Nike; to right, emperor (Philip the Arab) holding spear in left hand; at base, two captives.','from CN'),(3877,'Tropaion aus Panzer, Paludamentum, Helm und zwei Schilden; links davon, Nike im langen Gewand; rechts davon, Kaiser (Philippus Arabs) mit Panzer und Strahlenkrone, in der Linken Speer haltend; am Boden zwei Gefangene, mit phrygischer Mütze und hinter dem Rücken gefesselten Händen, Rücken an Rücken sitzend. Bildleiste. Perlkreis.','Trophy on shaft comprising of cuirass, paludamentum, helmet and two shields; to left, Nike, wearing long garment; to right, radiate emperor (Philip the Arab) wearing cuirass, holding spear in left hand; at base, two captives with Phrygian caps and bound arms behind back, seated back to back. Ground line. Border of dots.','from CN'),(3878,'Stadtring von Bizye; im Inneren verschiedene Gebäude.','City view of Bizye; inside, different buildings.','from CN'),(3879,'Brustbild des Philippus Arabs nach rechts mit Lorbeerkranz, Panzer und Paludamentum; über der linken Schulter die Ägis, auf der Brustplatte Adler.','Laureate bust of Philip the Arab, right, wearing cuirass and paludamentum; with aegis on left shoulder and eagle on breastplate.','from CN'),(3880,'Hades-Serapis, Demeter und Isis; in der Mitt