ght. Below, a tunny right.','from CN'),(7598,'Nach rechts kniender Bogenschütze mit einem Bogen und einem Pfeil in der aufgestreckten linken Hand, darunter ein Thunfisch nach rechts.','Archer kneeling to right with a bow and arrow in his outstretched left hand. Below, a tunny to right.','from CN'),(7599,'Bärtiger Kopf des Pharnabazos mit Keranoshaube nach rechts.','Bearded head of Pharnabazos to right wearing satrapal cap and diadem.','from CN'),(7600,'Prora nach links, verziert mit einem apotropäischem  Auge und einem Greif , gerahmt von zwei Delphinen, unten ein Thunfisch nach links.','Prora to left, decorated with an apotropaic eye and a griffin, framed by two dolphins. Below a tunny to the left.','from CN'),(7601,'Leier (kithara), darunter Thunfisch nach rechts.','Lyre (kithara). Below, a tunny to right.','from CN'),(7602,'Bärtiger männlicher Kopf mit Lorbeerkranz nach rechts, entlang des Halsabschnittes Thunfisch nach rechts unten.','Bearded male laureate head right, along his neck a tunny to lower right.','from CN'),(7603,'Männliche Figur mit Strahlenkrone (Kaiser Philippus Arabs?) nach rechts auf Mauer sitzend.','Radiate male figure (emperor Philip the Arab?) seated right on wall.','from CN'),(7604,'Nemesis (Dikaiosyne) nach links mit Waage und Stab (Ellemaß?).','Nemesis (Aequitas) standing left, holding scales and staff (cubit-rule?).','from CN'),(7605,'Keule aufrecht stehend mit überhängendem Löwenfell, in Blätterkranz.','Upright club with overhanging lion skin, the whole surrounded by an wreath.','from CN'),(7606,'dreiteilige Weintraube auf Weinblatt.','three-part bunch of grapes on vine leaf','from CN'),(7607,'Linksläufiges Swastika; zwischen den Armen jeweils zwei Striche.','Swastika; left-facing; between the legs two stripes.','from CN'),(7608,'Apollon nach links auf Omphalos sitzend mit Bogen in der Rechten.','Apollo seated left on omphalos, holding bow in right hand.','from CN'),(7609,'Göttin (Hera?) nach links mit Patera und Zepter.','Goddess (Hera?)