e, clean-shaven man with his head bowed down and crouching left. In each hand he holds a tunny.','from CN'),(7627,'Geflügelte Sphinx mit einer in zwei Spiralen endenden Lotosranke auf dem Scheitel nach links liegend, die rechte Tatze leicht erhebend. Darunter ein Thunfisch nach links.','Winged sphinx with a lotus tendril ending in two spirals on the crown of the head lying left, the right paw raised slightly. Below, a tunny left.','from CN'),(7628,'Schiffsvorderteil (prora) in Gestalt eines geflügelten Tieres (Wolf?). Unterhalb Thunfisch nach links.','Bow of a ship (prora) in the shape of a winged animal (wolf?). Below, a tunny left.','from CN'),(7629,'Korinthischer Helm nach rechts. Unterhalb Thunfisch nach links.','Corinthian helmet right. Below, a tunny left.','from CN'),(7630,'Kopf des Attis mit phrygischer Mütze nach rechts. Unterhalb ein Thunfisch.','Head of Attis right with Phrygian cap. Below, a tunny.','from CN'),(7631,'Panther stehend nach links auf einem Thunfisch nach links.','Panther standing left atop a tunny left.','from CN'),(7632,'Chimaira nach links. Darunter Thunfisch  nach links als Standlinie.','Chimaera left standing atop a tunny left.','from CN'),(7633,'Nackter Jüngling einen Delphin nach links reitend, in der ausgestreckten rechten Hand einen Thunfisch haltend. Darunter ein Thunfisch nach links.','Nude male youth riding a dolphin left, holding a tunny in his outstretched right hand. Below, a tunny left.','from CN'),(7634,'Nackter, unbärtiger Krieger mit korinthischem Helm nach links hockend. Mit der rechten Hand hält er eine Trompete an den Mund, in der gesenkten Linken ein Schwert in der Scheide. Darunter Thunfisch nach links als Standlinie.','Nude, clean-shaven warrior with Corinthian helmet crouching left. He holds a trumpet to his mouth in his right hand, and in his lowered left hand is a sheathed sword. Below, a tunny left.','from CN'),(7635,'Nackter, unbärtiger Krieger nach rechts hockened. Im linken Feld ein Thunfisch nach unten.','Nude, clean-shaven warrior crouching right. In left field, a downward tunny.','from CN'),(7636,'Helios mit Strahlenkrone nach rechts hockend. Mit beiden seitlich ausgestreckten Armen jeweils zwei nach außen springende Pferdeprotomen haltend. Darunter Thunfisch nach rechts als Standlinie.','Helios with radiate crown crouching right. With both arms stretched out to the side he holds two horse protomes, each jumping outwards. Below, a tunny right as the standing line.','from CN'),(7637,'Geflügeltes Fabelwesen (Phobos?) mit nacktem Körper eines Mannes sowie langohrigem, kurzmähnigen Raubiterkopf und Schweif  im Knielauf nach links. Mit der rechten Hand einen Thunfisch haltend, die linke Hand angewinkelt.','Winged mythical creature (Phobos?) with the nude body of a man as well as long-eared, short-maned head of a predator and tail crouching to left. With his right hand he holds a tunny, while the left hand is cocked at his side.','from CN'),(7638,'Kopf der Athena mit korinthischem Helm nach links. Darunter ein Thunfisch nach links.','Head of Athena with Corinthian helmet left. Below, a tunny left.','from CN'),(7639,'Kopf des Herakles mit Löwenfell nach rechts. Darunter ein Thunfisch nach rechts.','Head of Heracles right with lion pelt. Below, a tunny right.','from CN'),(7640,'Kopf des unbärtigen Aktaion mit Hirschgeweih und kurzem Haar nach links. Unterhalb ein Thunfisch nach links.','Head of a clean-shaven Actaeon left with deer antlers and short hair. Below, a tunny left.','from CN'),(7641,'Jugendlicher Dionysos mit Kranz sitzt auf einem Pantherfell nach links, in der rechten Hand hält er einen Kantharos. Vor seinem Knie Ende des mit Tänie umwickelten Thyrsos erkennbar. Unterhalb ein Thunfisch.','Youthful Dionysus with a wreath sitting left on a panther skin; in his right hand he holds a kantharos. In front of his knee, the end of a taenia-wrapped thyrsus is visible. Below, a tunny.','from CN'),(7642,'Nereide auf einem linkshin schwimmenden Delphin seitlich nach links sit