kes a snake, while Iphicles raises his hands pleadingly. Below, a tunny left.','from CN'),(7649,'Herakles sitzend auf Felsen, über den das Löwenfell gebreitet ist, nach links. Die Keule in seiner rechten Hand lehnt er an sein rechtes Knie, seinen leicht gesenkten Kopf wendet er nach rechts zurück. Unterhalb Thunfisch.','Heracles sitting left on rocks, over which the lion pelt is spread. He leans the club in his right hand against his right knee, and his slightly lowered head is turned back to the right. Below, a tunny.','from CN'),(7650,'Pferd mit losem Halfter nach links galoppierend. Unterhalb Thunfisch nach links.','Horse with loose halter galloping left. Below, a tunny left.','from CN'),(7651,'Adler mit angezogenen Fängen in Dreiviertelansicht nach rechts fliegend. Unterhalb Thunfisch nach rechts. Das Bild wird von einem erhabenen Ring eingefasst.','Eagle flying right in three-quarter view with its talons out. Below, a tunny right. The picture is framed by a raised ring.','from CN'),(7652,'Adler mit geschlossenen Flügeln und zurückgewendetem Kopf nach rechts stehend. Unterhalb Thunfisch nach rechts. Das Bild wird von einem erhabenen Ring eingefasst.','Eagle standing right with closed wings and with its head turned back. Below, a tunny right. The image is framed by a raised ring.','from CN'),(7653,'Thunfischkopf mit Stachel nach rechts, darunter Thunfisch nach rechts.','Tunny head with spine right. Below, a tunny right.','from CN'),(7654,'Nackter Dionysos nach links mit Kantharos und Weintraube (?); zu seinen Füßen Panther.','Nude Dionysus standing left, holding cantharus and bunch of grapes (?); at his feet, panther.','from CN'),(7655,'Hahnenprotome nach rechts mit dem Schnabel den Unterkiefer eines Thunfischkopf mit Stachel nach oben greifend.','Rooster protome right grasping with its beak the lower jaw of a tunny with the spine upwards.','from CN'),(7656,'Vogel mit geschlossenen Flügeln nach rechts. Oberhalb und unterhalb Thunfisch nach rechts.','Bird with closed wings right. Above and below, a tunny right.','from CN'),(7657,'Thunfischkopf mit Stachel nach rechts, ober- und unterhalb Thunfisch nach links.','Tunny head with spine right. Above and below, tunnies left.','from CN'),(7658,'Thunfischkopf mit Stachel nach rechts. Im Feld oben und unten eine Erhöhung.','Tunny head with spine right. In the field above and below a ridge.','from CN'),(7659,'Unregelmäßiges Quadratum incusum.','Irregular incuse square.','from CN'),(7660,'Artemis ? in einem von einem Hirsch gezogenenen Wagen nach rechts.','Artemis ? in cart drawn by stag, right.','from CN'),(7661,'Architekturteil (Brunnen oder Altar?).','Part of architecture (fountain or altar?).','from CN'),(7662,'Eros und Psyche, einander umarmend; links davon Altar.','Eros and Psychea, embracing each other; to left, altar.','from CN'),(7663,'Nackter, unbärtiger Perseus mit geflügelter phrygischer Kappe und Mantel (chlamys) um den Rücken mit zurückgewandtem Kopf nach rechts hockend; in der rechten Hand er eine Sichel haltend, in der linken den Kopf der Medusa. Unten ein Thunfisch nach rechts.','Nude, clean-shaven Perseus with winged Phrygian cap and a cloak (chlamys) around his shoulders squatting right with his head turned back. In his right hand he holds a sickle, and in his left the head of Medusa. Below, a tunny right.','from CN'),(7664,'Europa auf dem Stier nach links reitend. Unten ein Thunfisch nach links.','Europa riding a bull left. Below, a tunny left.','from CN'),(7665,'Halbnackte Aphrodite nach rechts, von hinten gesehen, mit Apfel in der Rechten, den linken Arm auf eine Säule gestützt.','Half-nude Aphrodite standing right, seen from behind, holding apple in right hand, resting left arm on column.','from CN'),(7666,'Bärtiger Flussgott (Oiskos) nach rechts mit Schilfrohr in der Linken, auf ein Quellgefäß gestützt.','Bearded river-god (Oiskos) reclining right, holding reed in left hand and resting on water-urn.','from CN'),(7667,'Tempelfront eines tetrastylen Tempels; darin Tyche nach links mit Kalathos, Steuerruder auf Kugel und Füllhorn.','Temple front of a tetrastyle temple; within statue of Concordia standing left, wearing Kalathos, holding rudder on sphere and cornucopia.','from CN'),(7668,'Ethnikon im unten gebundenen Lorbeerkranz.','Ethnic within laurel wreath, bound at bottom.','from CN'),(7669,'Brustbild der Iulia Cornelia Paula mit Gewand nach rechts.','Draped bust of Iulia Cornelia Paula, right.','from CN'),(7670,'Artemis im kurzen, wehenden Chiton, mit wehendem Mantel und in Stiefeln, nach rechts schreitend, in der vorgestreckten Linken Bogen, in der Rechten einen Pfeil aus dem Köcher am Rücken ziehend.','Artemis advancing right, wearing short fluttering chiton, fluttering cloak and boots, holding bow in left hand and drawing arrow from quiver at shoulder with right hand.','from CN'),(7671,'Ares nach links stehend,, mit Panzer, Stiefeln und korinthischen Helm mit Helmbusch, die Rechte auf dem Schild, die Linke am Speer.','Ares standing left, wearing cuirass, boots and crested Corinthian helmet, right hand on shield and left hand on spear.','from CN'),(7672,'Hygieia und Asklepios; links Hygieia nach rechts stehend, die Schlange im rechten Arm aus einer Patera in ihrer Linken fütternd; rechts Asklepios von vorn, Kopf nach links, die Rechte auf den Schlangenstab gestützt.','Hygieia and Asclepius; to left, Hygieia standing right, feeding serpent held in right arm from patera in outstretched left hand; to right, Asclepius standing facing, head left, resting right hand on serpent-staff in right hand.','from CN'),(7673,'Tyche mit Chiton und Himation nach links, linkes Bein gebeugt, mit Steuerruder auf Kugel und Füllhorn.','Tyche standing left, wearing chiton and himation, with bent right knee,  holding rudder with sphere and cornucopia.','from CN'),(7674,'Kopf des Elagabal mit Lorbeerkranz und Brustbild der Iulia Maesa mit Stephane und Gewand, einander zugekehrt.','Confronted head of Elagabalus, laureate, and bust of Julia Maesa